INSERT INTO `mdl_tool_customlang` VALUES ('314', 'es', '1', 'courselegacyfiles_help', 'The course files area provides some backward compatibility with Moodle 1.9 and earlier.  All files in this area are always accessible to all participants in the course (whether you link to them or not) and there is no way to know where any of these files are being used in Moodle.\n\nIf you use this area to store course files, you can expose yourself to a number of privacy and security issues, as well as experiencing missing files in backups, course imports and any time content is shared or re-used.  It is therefore recommended that you do not use this area unless you really know what you are doing.', 'El rea de archivos del curso proporciona cierta compatibilidad hacia atrs con las versiones de Moodle 1.9 y anteriores. Todos los archivos de este rea son siempre accesibles a todos los participantes en el curso (tanto si enlaza a ellos como si no) y no hay manera de saber dnde se pueden estar usando en Moodle cualquiera de estos archivos.\n\nSi utiliza este rea para almacenar archivos de curso, puede exponerse a una serie de riesgos de privacidad y de seguridad, as como a la prdida de archivos en las copias de seguridad, en las importaciones de cursos o cada vez que el contenido del curso sea compartido o reutilizado. Por ello se recomienda que no utilice esta rea a menos que realmente sepa lo que est haciendo.', null, '1472075862', null, '0', '0');
