INSERT INTO `mdl_tool_customlang` VALUES ('497', 'es', '1', 'edhelpfontsize', 'The default font-size sets the size of a font. <br />Valid values are for example: medium, large, smaller, larger, 10pt, 11px.', 'El tamao por defecto de la fuente ajusta dicho tamao. <br />Valores vlidos son, por ejemplo: medium, large, smaller, larger, 10pt, 11px.', null, '1472075881', null, '0', '0');
