INSERT INTO `mdl_tool_customlang` VALUES ('811', 'es', '1', 'idnumbercourse_help', 'The ID number of a course is only used when matching the course against external systems and is not displayed anywhere on the site. If the course has an official code name it may be entered, otherwise the field can be left blank.', '<P>El nmero ID de un curso nicamente se usa cuando se compara este curso contra un sistema externo - lo cual nunca es mostrado dentro de Moodle. Si tiene un cdigo oficial para este curso selo aqu ... de otra forma lo puede dejar en blanco.</p>', null, '1472075910', null, '0', '0');
