INSERT INTO `mdl_tool_customlang` VALUES ('817', 'es', '1', 'idnumbermod_help', 'Setting an ID number provides a way of identifying the activity for grade calculation purposes. If the activity is not included in any grade calculation then the ID number field may be left blank.\n\nThe ID number can also be set in the gradebook, though it can only be edited on the activity settings page.', 'El nmero ID proporciona una forma de identificar la actividad a fin de poder calcular la calificacin. Si la actividad no est incluida en ningn clculo de calificacin, el campo Nmero ID puede dejarse en blanco. El Nmero ID puede asimismo ajustarse en la pgina de edicin del clculo de calificaciones, si bien nicamente\npuede editarse en la pgina de actualizacin de la actividad.', null, '1472075910', null, '0', '0');
