INSERT INTO `mdl_tool_customlang` VALUES ('900', 'es', '1', 'loginsteps', 'For full access to this site, you first need to create an account.', 'Hola. Para acceder al sistema tmese un minuto para\ncrear una cuenta.\nCada curso puede disponer de una \"clave de acceso\"\nque slo tendr que usar la primera vez.\nEstos son los pasos:\n<ol>\n<li>Rellene el <a href=\"{$a}\">Formulario de Registro</a> con sus datos.</li>\n<li>El sistema le enviar un correo para verificar que su direccin sea correcta.</li>\n<li>Lea el correo y confirme su matrcula.</li>\n<li>Su registro ser confirmado y usted podr acceder al curso.</li>\n<li>Seleccione el curso en el que desea participar.</li>\n<li>Si algn curso en particular le solicita una \"contrasea de acceso\"\nutilice la que le facilitaron cuando se matricul.\nAs quedar matriculado.</li>\n<li>A partir de ese momento no necesitar utilizar ms que su nombre de usuario y contrasea\nen el formulario de la pgina\npara entrar a cualquier curso en el que est matriculado.</li>\n</ol>', null, '1472075918', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('901', 'es', '1', 'loginstepsnone', '<p>Hi!</p>\n<p>For full access to courses you\'ll need to create yourself an account.</p>\n<p>All you need to do is make up a username and password and use it in the form on this page!</p>\n<p>If someone else has already chosen your username then you\'ll have to try again using a different username.</p>', '<p>Hola!</p>\n<p>Para acceder a todos los cursos necesita crear una cuenta.</p>\n<p>Todo lo que tiene que hacer es inscribirse en esta pgina.</p>\n<p>Si alguna otra persona hubiera elegido su nombre de usuario o su contrasea, deber elegir un nombre de usuario diferente.</p>', null, '1472075918', null, '0', '0');
