INSERT INTO `mdl_tool_customlang` VALUES ('1065', 'es', '1', 'newpasswordfromlost', '<strong>NOTICE:</strong> Your <strong>Current password</strong> will have been sent to you in the <strong>second</strong> of the two emails sent as part of the lost password recovery process. Make sure you have received your replacement password before continuing with this screen.', '<strong>AVISO:</strong> Su<strong>Contrasea actual</strong> ha sido enviada en el <strong>segundo</strong> de los dos correos electrnicos enviados como parte del proceso de recuperacin de la contrasea perdida. Asegrese de que ha recibido la nueva contrasea antes de continuar con esta pantalla.', null, '1472075931', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1066', 'es', '1', 'newpasswordtext', 'Hi {$a->firstname},\n\nYour account password at \'{$a->sitename}\' has been reset\nand you have been issued with a new temporary password.\n\nYour current login information is now:\n   username: {$a->username}\n   password: {$a->newpassword}\n\nPlease go to this page to change your password:\n   {$a->link}\n\nIn most mail programs, this should appear as a blue link\nwhich you can just click on.  If that doesn\'t work,\nthen cut and paste the address into the address\nline at the top of your web browser window.\n\nCheers from the \'{$a->sitename}\' administrator,\n{$a->signoff}', 'Hola, {$a->firstname}.\n\nLa contrasea de su cuenta en \'{$a->sitename}\' se ha\ncancelado y se le ha otorgado una nueva contrasea temporal.\n\nSu nueva informacin de acceso es:\n   Nombre de usuario: {$a->username}\n   Contrasea: {$a->newpassword}\n\nDirjase por favor a esta pgina y cambie su contrasea temporal por una que pueda recordar mejor:\n   {$a->link}\n\nEn la mayora de los programas de correo electrnico el\nenlace anterior aparecer como una lnea de texto en azul\nsobre la que puede hacer clic. Si eso no sucede, copie y\npegue la direccin en la barra de direcciones de su navegador.\n\nAtte. El Administrador de \'{$a->sitename}\',\n{$a->signoff}', null, '1472075931', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1067', 'es', '1', 'newpicture', 'New picture', 'Imagen nueva', null, '1472075931', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1068', 'es', '1', 'newpicture_help', 'To add a new picture, browse and select an image (in JPG or PNG format) then click \"Update profile\". The image will be cropped to a square and resized to 100x100 pixels.', '<P>Usted puede subir una imagen desde su ordenador al servidor, y esta imagen se\nutilizar en varios lugares para identificarlo.\n<P>Por este motivo, las mejores imgenes son las de estilo identificacin, aunque\npuede utilizar la imagen que desee.\n<P>La imagen debe ser formato JPG o PNG (lo que significa que el nombre de la imagen\nterminar en .jpg o en .png) y debe tener un tamao de 100 x 100 pxeles o ms.\n<P>Puede colocar una imagen utilizando uno de estos cuatro mtodos:\n\n<OL>\n<LI>Utilizando una cmara digital, es muy sencillo, dado que sus fotos seguramente\nya estarn en el formato correcto en su ordenador.\n<LI>Utilizando un \"scanner\" para digitalizar una fotografa impresa. Asegrese de\nguardar la imagen en formato JPG o PNG.\n<LI>Si usted es una artista, puede dibujar una imagen utilizando algn programa de diseo.\n<LI>Tambin puede conseguir una imagen que lo identifique en la red.\n<A TARGET=google HREF=\"http://images.google.com/\">http://images.google.com</A>\nes un excelente lugar para buscar imgenes. Una vez encontrada, coloque el cursor\nsobre ella y pulsando el botn derecho del ratn elija la opcin \"Guardar imagen como\".\n(Diferentes ordenadores pueden variar en este procedimiento)\n</OL>\n\n<P>Para subir la imagen, haga clic en el botn \"Examinar\" en esta pgina y seleccione\nla imagen en su disco duro.\n<P>IMPORTANTE: Asegrese de no subir una imagen que exceda el tamao\nmximo permitido, en bites, pues no se cargar.\n<P>Luego haga clic en \"Actualizar informacin personal\" en la parte inferior de la pgina; si la imagen\nes mayor a 100 x 100 pxeles se cortar.\n<P>Cuando acabe de cambiar su imagen es posible que no vea el cambio; si eso sucede\nactualice la pgina (oprimiendo F5 o el botn actualizar).', null, '1472075931', null, '0', '0');
