INSERT INTO `mdl_tool_customlang` VALUES ('1076', 'es', '1', 'newusernewpasswordtext', 'Hi {$a->firstname},\n\nA new account has been created for you at \'{$a->sitename}\'\nand you have been issued with a new temporary password.\n\nYour current login information is now:\n   username: {$a->username}\n   password: {$a->newpassword}\n             (you will have to change your password\n              when you login for the first time)\n\nTo start using \'{$a->sitename}\', login at\n   {$a->link}\n\nIn most mail programs, this should appear as a blue link\nwhich you can just click on.  If that doesn\'t work,\nthen cut and paste the address into the address\nline at the top of your web browser window.\n\nCheers from the \'{$a->sitename}\' administrator,\n{$a->signoff}', 'Hola, {$a->firstname},\n\nSe le ha abierto una nueva cuenta en \'{$a->sitename}\'\ny se le ha asignado una nueva contrasea temporal.\n\nLa informacin para entrar es:\nnombre de usuario: {$a->username}\ncontrasea: {$a->newpassword}\n(deber cambiar su contrasea cuando acceda por primera vez)\n\nPara comenzar a usar \'{$a->sitename}\', entre en\n{$a->link}\n\nEn la mayora de programas de correo electrnico, debera aparecer en forma de enlace azul sobre el que simplemente puede hacer clic. Si eso no funciona, copie y pegue la direccin en la barra de direcciones del navegador.\n\nUn saludo del administrador de \'{$a->sitename}\',\n{$a->signoff}', null, '1472075931', null, '0', '0');
