INSERT INTO `mdl_tool_customlang` VALUES ('1353', 'es', '1', 'rolerenaming_help', 'This setting allows the displayed names for roles used in the course to be changed. Only the displayed name is changed - role permissions are not affected.  New role names will appear on the course participants page and elsewhere within the course. If the renamed role is one that the administrator has selected as a course manager role, then the new role name will also appear as part of the course listings.', 'Esta configuracin permite cambiar los nombres mostrados en los roles usados en el curso. <P>Slo se cambia el nombre mostrado - los permisos de los roles no se vean afectados. <P>Los nuevos nombres de los roles aparecern en la pgina de participantes en el curso y all donde se muestren estos.\n<P>Si el rol renombrado corresponde a un rol de gestor del curso, asignado por el administardor, el nuevo nombre del rol tambin aparecer como parte de las listas de cursos.', null, '1472075956', null, '0', '0');
