INSERT INTO `mdl_tool_customlang` VALUES ('1372', 'es', '1', 'scale_help', 'A scale provides a way of evaluating or grading performance in an activity. It is defined by an ordered list of values, ranging from negative to positive, separated by commas, for example \"Disappointing, Not good enough, Average, Good, Very good, Excellent!\"', '<p>En cualquier curso los profesores pueden crear nuevas escalas\npersonalizadas con el objeto de llevar a cabo cualquier actividad de\nevaluacin.</p>\n\n<p>El nombre de la escala debera ser una frase que la identifique con\nclaridad: ese nombre aparecer tanto en listas de seleccin de escalas\ncomo en los botones de ayuda sensibles al contexto.</p>\n\n<p>La propia escala se define como una lista jerrquica de valores, de negativo\na positivo, separados por comas. Por ejemplo:</p>\n\n<blockquote><i>\n   Insuficiente, Regular, Promedio, Bueno, Muy bueno, Excelente!\n</i></blockquote>\n\n<p>Las escalas deberan asimismo incluir una descripcin adecuada de lo\nque significan y cmo deberan utilizarse. Esta descripcin aparecer\nen las pginas de ayuda para profesores y estudiantes.</p>\n\n<p>Por ltimo, puede haber una o ms escalas \"estndar\" definidas en el\nsitio por el administrador del sistema. Estas escalas estarn\ndisponibles en todos los cursos.</p>', null, '1472075958', null, '0', '0');
