INSERT INTO `mdl_tool_customlang` VALUES ('1386', 'es', '1', 'search_help', 'For basic searching of one or more words anywhere in the text, just type them separated by spaces. All words longer than two characters are used.\n\nFor advanced searching, press the search button without typing anything in the search box to access the advanced search form.', 'Para realizar una bsqueda bsica de una o ms palabras en cualquier lugar del texto, simplemente escrbalas separadas por espacios. Se usarn todas las palabras de ms de dos caracteres.\n\nPara realizar una bsqueda avanzada, pulse el botn de bsqueda sin teclear nada en la caja de texto.', null, '1472075959', null, '0', '0');
