INSERT INTO `mdl_tool_customlang` VALUES ('1391', 'es', '1', 'searchhelp', '<p>You can search for multiple words at once and can refine your search as follows:</p>\n<ul>\n<li>word - find any match of this word within the text.</li>\n<li>+word - only exact matching words will be found.</li>\n<li>-word - don\'t include results containing this word.</li>\n</ul>', '<p>Puede buscar muchas palabras al mismo tiempo y puede refinar la bsqueda del siguiente modo:</p>\n<ul>\n<li>palabra - buscar cualquier coincidencia de sta palabra en el texto.</li>\n<li>+palabra - se encontrarn slo las palabras que coincidan exactamente.</li>\n<li>-palabra - no incluir resultados que contengan sta palabra.</li>\n</ul>', null, '1472075960', null, '0', '0');
