INSERT INTO `mdl_tool_customlang` VALUES ('1438', 'es', '1', 'separateandconnected', 'Separate and Connected ways of knowing', 'Vas de conocimiento separadas y conectadas', null, '1472075965', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1439', 'es', '1', 'separateandconnectedinfo', 'The scale based on the theory of separate and connected knowing. This theory describes two different ways that we can evaluate and learn about the things we see and hear.<ul><li><strong>Separate knowers</strong> remain as objective as possible without including feelings and emotions. In a discussion with other people, they like to defend their own ideas, using logic to find holes in opponent\'s ideas.</li><li><strong>Connected knowers</strong> are more sensitive to other people. They are skilled at empathy and tends to listen and ask questions until they feel they can connect and \"understand things from their point of view\". They learn by trying to share the experiences that led to the knowledge they find in other people.</li></ul>', 'La escala est basada en la teora de las vas de conocimiento separadas (aprendizaje individual)  y conectadas (aprendizaje colaborativo). Esta teora describe dos maneras diferentes con las que podemos evaluar y aprender a partir de lo que vemos y omos. <li><strong> Conocedores separados (individulaistas) </strong> se mantiene lo la ms objetivso posible, sin incluir sentimientos y emociones. En una discusin con otras personas, les gusta defender sus propias ideas, usando la lgica para encontrar fisuras en las ideas del adversario. </li> <li> <strong> Conocedores conectados (colaborativos) </strong> son ms sensibles a otras personas. Son expertos en empata y tienden a escuchar y hacer preguntas hasta que sienten que pueden conectar y \"entender las cosas desde otros punto de vista\". Aprenden tratando de compartir experiencias lo que les permite encontrar el conocimiento en las dems personas.', null, '1472075965', null, '0', '0');
