INSERT INTO `mdl_tool_customlang` VALUES ('1475', 'es', '1', 'showreports_help', 'Activity reports are available for each participant that show their activity in the course. As well as listings of their contributions, such as forum posts or assignment submissions, these reports also include access logs. This setting determines whether a student can view their own activity reports via their profile page.', '<p>Los informes de actividades estn disponibles para todos los participantes que muestren sus actividades en el presente curso. Al igual que las listas de contribuciones, estos informes incluyen un detallado registro de los accesos.</p>\n\n<p>Los profesores siempre tendrn acceso a estos informes usando el enlace existente en el pgina de informacin personal de cada participante.</p>\n\n<p>El acceso de los estudiantes a sus propios informes es controlado por el profesor a travs la configuracin misma del curso. En algunos cursos estos informes pueden ser una herramienta muy til para que el estudiante sepa su evolucion en el curso, si bien en otros casos es posible que no sea necesario.</p>\n\n<p>Otra razn para deshabilitarlo es que los informes pueden recargar ligeramnete el servidor cuando se generan. Para grandes grupos puede ser ms eficiente mantenerlo deshabilitado.</p>', null, '1472075969', null, '0', '0');
