INSERT INTO `mdl_tool_customlang` VALUES ('1819', 'es', '3', 'additionalhtml_desc', 'These settings allow you to specify HTML that you want added to every page. You can set HTML that will be added within the HEAD tag for the page, immediately after the BODY tag has been opened, or immediately before the body tag is closed.<br />Doing this allows you add custom headers or footers on every page, or add support for services like Google Analytics very easily and independent of your chosen theme.', 'Estos ajustes permiten especificar el cdigo HTML que desea aadir a cada pgina. Puede editar el HTML que ser agregado dentro de la etiqueta HEAD de la pgina, inmediatamente despus de la etiqueta de apertura de BODY, o inmediatamente antes de la etiqueta de cierre. <br /> Hacer esto le permite agregar encabezados o pies de pgina en cada pgina, o aadir soporte para servicios como Google Analytics con mucha facilidad e independiente de la plantilla elegida.', null, '1472076002', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1820', 'es', '3', 'additionalhtmlhead', 'Within HEAD', 'Dentro del Encabezado', null, '1472076002', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1821', 'es', '3', 'additionalhtmlhead_desc', 'Content here will be added to the bottom of the HEAD tag for every page.', 'Este contenido se agregar al final de la etiqueta HEAD en cada pgina. ', null, '1472076002', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1822', 'es', '3', 'additionalhtmltopofbody', 'When BODY is opened', 'Cuando BODY est abierto', null, '1472076002', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1823', 'es', '3', 'additionalhtmltopofbody_desc', 'Content here will be added in to every page immediately after the opening body tag.', 'Este contenido se agregar a cada pgina justo despus de que se abra la etiqueta BODY.', null, '1472076002', null, '0', '0');
