INSERT INTO `mdl_tool_customlang` VALUES ('1853', 'es', '3', 'authpreventaccountcreation_help', 'When a user authenticates, an account on the site is automatically created if it doesn\'t yet exist. If an external database, such as LDAP, is used for authentication, but you wish to restrict access to the site to users with an existing account only, then this option should be enabled. New accounts will need to be created manually or via the upload users feature. Note that this setting doesn\'t apply to MNet authentication.', 'Cuando un usuario se identifica, si an no existe su cuenta, se crea una en el sitio de forma automtica. Si se utiliza una base de datos externa para la identificacin, por ejemplo LDAP, pero se desea restringir el acceso al sitio solo a los usuarios con una cuenta existente, esta opcin debe estar habilitada. Las nuevas cuentas tendrn que ser creadas manualmente o mediante la funcin de carga de usuarios. Tenga en cuenta que este ajuste no se aplica a la identificacin MNet.', null, '1472076006', null, '0', '0');
