INSERT INTO `mdl_tool_customlang` VALUES ('1873', 'es', '3', 'blockprotect_help', 'If you lock a particular type of block, then no-one will be able to add or delete instances. (You can, of course, unlock again if you need to edit instances.)\n\nThis is intended to protect blocks like the navigation and settings which are very hard to get back if accidentally deleted.', 'Si bloquea un determinado tipo de bloque, entonces nadie ser capaz de aadir o eliminar instancias. (Usted puede, por supuesto, desbloquear de nuevo si necesita editar alguno.)\n\nCon ello se pretende proteger los bloques de la misma manera que navegacin y ajustes, que son muy difciles de recuperar en caso de eliminarse.', null, '1472076007', null, '0', '0');
