INSERT INTO `mdl_tool_customlang` VALUES ('1912', 'es', '3', 'condifmodeditdefaults', 'Default values are used in the settings form when creating a new activity or resource.', 'Los valores por defecto se utilizan en el formulario de configuracin cuando se crea una nueva actividad o recurso.', null, '1472076010', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1913', 'es', '3', 'confeditorhidebuttons', 'Select the buttons that should be hidden in the HTML editor.', 'Seleccione los botones que deberan estar ocultos en el editor HTML.', null, '1472076010', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1914', 'es', '3', 'configallcountrycodes', 'This is the list of countries that may be selected in various places, for example in a user\'s profile. If blank (the default) the list in countries.php in the standard English language pack is used. That is the list from ISO 3166-1. Otherwise, you can specify a comma-separated list of codes, for example \'GB,FR,ES\'. If you add new, non-standard codes here, you will need to add them to countries.php in \'en\' and your language pack.', 'Esta es la lista de pases que pueden ser seleccionadas en varios lugares, por ejemplo, en el perfil de un usuario. Si est en blanco (por defecto) se utilizar la lista de \'countries.php\' en el paquete de idioma Ingls estndar. Esta es la lista de la norma ISO 3166-1. De lo contrario, puede especificar una lista separada por comas de los cdigos, por ejemplo, \"GB, FR, ES. Si se agregan nuevos cdigos, no estndar aqu, tendr que aadirlos a countries.php en \'en\' y su paquete de idioma.', null, '1472076010', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1915', 'es', '3', 'configallowassign', 'You can allow people who have the roles on the left side to assign some of the column roles to other people', 'Puede permitir a las personas que tienen los roles de la izquierda asignar algunos de los roles de la columna a otras personas', null, '1472076010', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1916', 'es', '3', 'configallowblockstodock', 'If enabled and supported by the selected theme users can choose to move blocks to a special dock.', 'Si se activa y est soportado por el tema seleccionado, los usuarios pueden optar por mover los bloques a una barra lateral \'dock\' especial', null, '1472076011', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1917', 'es', '3', 'configallowcategorythemes', 'If you enable this, then themes can be set at the category level. This will affect all child categories and courses unless they have specifically set their own theme. WARNING: Enabling category themes may affect performance.', 'Si activa esta opcin, los temas pueden ajustarse al nivel de la categora. Esto afectar a todas las categoras y cursos de nivel inferior (\'hijos\') a menos que tengan especificado su propio tema. ATENCIN: Habilitar esta opcin puede afectar al rendimiento.', null, '1472076011', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1918', 'es', '3', 'configallowcoursethemes', 'If you enable this, then courses will be allowed to set their own themes.  Course themes override all other theme choices (site, user, or session themes)', 'Si activa esta opcin, se permitir a los cursos ajustar sus propios temas. Los temas de los cursos pasan por alto cualesquiera otras opciones de tema (sitio, usuario o sesin)', null, '1472076011', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1919', 'es', '3', 'configallowemailaddresses', 'If you want to restrict all new email addresses to particular domains, then list them here separated by spaces.  All other domains will be rejected.  To allow subdomains add the domain with a preceding \'.\'. eg <strong>ourcollege.edu.au .gov.au</strong>', 'Si desea restringir todas las direcciones nuevas de correo a dominios particulares, lstelos aqu separados por espacios. El resto de los dominios ser rechazado, e.g., <strong>ourcollege.edu.au .gov.au</strong>', null, '1472076011', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1920', 'es', '3', 'configallowguestmymoodle', 'If enabled guests can access Dashboard, otherwise guests are redirected to the site front page.', 'Si se habilita los invitados podrn acceder al rea Personal, de lo contrario los invitados sern redirigidos a la pgina principal del sitio.', null, '1472076011', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1921', 'es', '3', 'configallowobjectembed', 'As a default security measure, normal users are not allowed to embed multimedia (like Flash) within texts using explicit EMBED and OBJECT tags in their HTML (although it can still be done safely using the mediaplugins filter).  If you wish to allow these tags then enable this option.', 'Como medida de seguridad por defecto, los usuarios normales no podrn incrustar en el cdigo HTML objetos multimedia (e.g., Flash) dentro del texto utilizando las marcas explcitas EMBED y OBJECT (si bien podr hacerse con seguridad utilizando el filtro mediaplugins). Active la opcin si desea permitir dichas marcas.', null, '1472076011', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1922', 'es', '3', 'configallowoverride', 'You can allow people with the roles on the left side to override some of the column roles', 'Puede permitir a las personas que tengan los roles de la izquierda anular algunos de los roles de la columna', null, '1472076012', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1923', 'es', '3', 'configallowoverride2', 'Select which role(s) can be overridden by each role in the left column.<br />Note that these settings only apply to users who have either the capability moodle/role:override or the capability moodle/role:safeoverride allowed.', 'Seleccione qu rol(es) puede(n) ser invalidado(s) por cada rol de la columna izquierda.<br />Note que estos ajustes slo se aplican a los usuarios que tienen permiso en \'moodle/role:override\' o en \'moodle/role:safeoverride\'.', null, '1472076012', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1924', 'es', '3', 'configallowswitch', 'Select which roles a user may switch to, based on which roles they already have. In addition to an entry in this table, a user must also have the moodle/role:switchroles capability to be able to switch.<br />Note that it is only possible to switch to roles that have the moodle/course:view capability, and that do not have the moodle/site:doanything capability, so some columns in this table are disabled.', 'Seleccione a qu roles puede cambiar un usuario, de entre los roles que ya tiene asignados. Adems de una entrada en esta tabla el usuario debe tener  tambin el permiso moodle/role:switchroles para poder cambiar de rol', null, '1472076012', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1925', 'es', '3', 'configallowthemechangeonurl', 'If enabled, the theme can be changed by adding either:<br />?theme=themename to any Moodle URL (eg: mymoodlesite.com/?theme=afterburner ) or <br />&theme=themename to any internal Moodle URL (eg: mymoodlesite.com/course/view.php?id=2&theme=afterburner ).', 'Si est activado, el tema grfico se puede cambiar mediante la adicin de <br/>?theme=nombredeltema a cualquier URL de Moodle (ej: misitiomoodle.com/?theme=afterburner) o <br/>&theme=nombredeltema a cualquier URL interna de Moodle (ej: misitiomoodle.com/course/view.php?id=2&theme=afterburner)', null, '1472076012', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1926', 'es', '3', 'configallowuserblockhiding', 'Do you want to allow users to hide/show side blocks throughout this site?  This feature uses Javascript and cookies to remember the state of each collapsible block, and only affects the user\'s own view.', 'Desea que los usuarios puedan mostrar u ocultar bloques laterales en el sitio? Esta opcin usa Javascript y \'cookies\' para recordar el estado de cada bloque colapsable, y slo afecta al modo en que cada usuario ve la informacin.', null, '1472076012', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1927', 'es', '3', 'configallowuserswitchrolestheycantassign', 'By default, moodle/role:assign is required for users to switch roles. Enabling this setting removes this requirement, and results in the roles available in the \"Switch role to\" dropdown menu being determined by settings in the \"Allow role assignments\" table only.\nIt is recommended that the settings in the \"Allow role assignments\" table do not allow users to switch to a role with more capabilities than their existing role.', 'Por defecto es necesario tener el permiso moodle/role:assign para cambiar roles. Habilitando este ajuste se elimina este requisito de manera que que los roles disponibles en el men desplegable \"Cambiar rol a\" estn determinados nicamente por los ajustes de la tabla \"Permitir asignacin de roles\". Se recomienda que los ajustes de la tabla \"Permitir asignacin de roles\" no den  permisos a los usuarios para cambiarse a un rol con ms capacidades que las de su rol actual.', null, '1472076012', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1928', 'es', '3', 'configallowuserthemes', 'If you enable this, then users will be allowed to set their own themes.  User themes override site themes (but not course themes)', 'Si se activa esta opcin, los usuarios podrn elegir sus propios temas. Los temas de los usuarios anulan los temas del sitio (pero no los temas del curso)', null, '1472076012', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1929', 'es', '3', 'configallusersaresitestudents', 'For activities on the front page of the site, should ALL users be considered as students?  If you answer \"Yes\", then any confirmed user account will be allowed to participate as a student in those activities.  If you answer \"No\", then only users who are already a participant in at least one course will be able to take part in those front page activities. Only admins and specially assigned teachers can act as teachers for these front page activities.', 'En lo que concierne a las actividades de la pgina principal del sitio, deberan todos los usuarios ser considerados como estudiantes? Si la respuesta es \"S\", cualquier usuario con cuenta confirmada podr participar como estudiante en tales actividades. Si la respuesta es \"No\", slo los usuarios que ya participan en al menos un curso podrn tomar parte en las actividades de la pgina principal. Slo los administradores y profesores especialmente asignados pueden actuar como profesores en las actividades de la pgina principal.', null, '1472076012', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1930', 'es', '3', 'configauthenticationplugins', 'Please choose the authentication plugins you wish to use and arrange them in order of failthrough.', 'Por favor, seleccione los \'plugins\' de identificacin que desea utilizar y dispngalos en orden de fallo.', null, '1472076012', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1931', 'es', '3', 'configautolang', 'Detect default language from browser setting, if disabled site default is used.', 'Detectar idioma por defecto desde el ajuste del navegador. Si est deshabilitado, se utiliza el idioma por defecto del sitio.', null, '1472076012', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1932', 'es', '3', 'configautologinguests', 'Should visitors be logged in as guests automatically when entering courses with guest access?', 'Deber permitirse a los visitantes automticamente el acceso como invitados cuando entran a los cursos con acceso de invitado?', null, '1472076013', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1933', 'es', '3', 'configbloglevel', 'This setting allows you to restrict the level to which user blogs can be viewed on this site.  Note that they specify the maximum context of the VIEWER not the poster or the types of blog posts.  Blogs can also be disabled completely if you don\'t want them at all.', 'Esta opcin le permite restringir el nivel en el que pueden verse los blogs de los usuarios en este sitio. Advierta que se especifica el contexto mximo de quien los ve, pero no de quien enva mensajes ni de los tipos de mensaje enviados al blog. Los blogs pueden tambin deshabilitarse completamente si as lo desea.', null, '1472076013', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1934', 'es', '3', 'configcalendarcustomexport', 'Enable custom date range export of calendar', 'Habilitar exportacin personalizada de un rango de fechas del calendario', null, '1472076013', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1935', 'es', '3', 'configcalendarexportsalt', 'This random text is used for improving of security of authentication tokens used for exporting of calendars. Please note that all current tokens are invalidated if you change this hash salt.', 'Esta cadena de caracteres aleatorios se utiliza para mejorar las claves de seguridad (tokens) de identificacin utilizadas para la exportacin de los calendarios. Tenga en cuenta que todas las claves de seguridad actuales quedarn invalidadas si modifica esta sal.', null, '1472076013', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1936', 'es', '3', 'configcookiehttponly', 'Enables new PHP 5.2.0 feature - browsers are instructed to send cookie with real http requests only, cookies should not be accessible by scripting languages. This is not supported in all browsers and it may not be fully compatible with current code. It helps to prevent some types of XSS attacks.', 'Habilita la nueva caracterstica de PHP 5.2.0: se instruye a los navegadores para que enven una \'cookie\' slo a peticin de http reales. Las \'cookies\' no deberan ser accesibles desde lenguajes de script. No todos los navegadores pueden ejecutar esta opcin, y podra no ser compatible con el cdigo actual. Ayuda a prevenir algunos tipos de ataques XSS.', null, '1472076013', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1937', 'es', '3', 'configcookiesecure', 'If server is accepting only https connections it is recommended to enable sending of secure cookies. If enabled please make sure that web server is not accepting http:// or set up permanent redirection to https:// address. When <em>wwwroot</em> address does not start with https:// this setting is turned off automatically.', 'Si el servidor nicamente acepta conexiones https, se recomienda habilitar el envo de \'cookies\' seguras. Si la opcin est activada, asegrese por favor de que el servidor web no acepta http:// ni ha fijado una redireccin permanente a direcciones https:// Cuando una direccin <em>wwwroot</em> no comienza con https:// este ajuste se desactiva automticamente.', null, '1472076013', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1938', 'es', '3', 'configcountry', 'If you set a country here, then this country will be selected by default on new user accounts.  To force users to choose a country, just leave this unset.', 'Si selecciona un pas, dicho pas quedar como valor por defecto para nuevos usuarios o cuentas. Para forzar a los usuarios a elegir un pas, deje la opcin sin seleccionar.', null, '1472076013', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1939', 'es', '3', 'configcourseoverviewfilesext', 'A comma-separated list of allowed course summary files extensions.', 'Lista separada por comas de las extensiones de archivos permitidas en la vista general del curso.', null, '1472076013', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1940', 'es', '3', 'configcourseoverviewfileslimit', 'The maximum number of files that can be attached to a course summary.', 'Nmero mximo de archivos que pueden adjuntarse al sumario de un curso.', null, '1472076013', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1941', 'es', '3', 'configcourserequestnotify', 'Type username of user to be notified when new course requested.', 'Escriba el nombre de usuario a quien se enviar una notificacin cuando se solicite un nuevo curso', null, '1472076013', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1942', 'es', '3', 'configcourserequestnotify2', 'Users who will be notified when a course is requested. Only users who can approve course requests are listed here.', 'Usuarios a quienes se notificar cuando un campo es requerido. En esta lista figuran nicamente los usuarios que pueden aprobar las solicitudes de curso.', null, '1472076013', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1943', 'es', '3', 'configcoursesperpage', 'Enter the number of courses to be displayed per page in a course listing.', 'Introduzca el nmero de cursos a mostrar por pgina en un listado de cursos.', null, '1472076013', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1944', 'es', '3', 'configcourseswithsummarieslimit', 'The maximum number of courses to display in a course listing including summaries before falling back to a simpler listing.', 'El nmero mximo de cursos que se mostrarn en un listado de cursos que incluye resmenes antes de volver de nuevo a una lista simple.', null, '1472076014', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1945', 'es', '3', 'configcronclionly', 'Running the cron from a web browser can expose privileged information to anonymous users. Thus it is recommended to only run the cron from the command line or set a cron password for remote access.', 'Ejecutar el programador de tareas cron desde un navegador web puede exponer informacin privilegiada a usuarios annimos. Por ello se recomienda ejecutar cron solamente desde la lnea de comandos o establecer una contrasea en cron para el acceso remoto.', null, '1472076014', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1946', 'es', '3', 'configcronremotepassword', 'This means that the cron.php script cannot be run from a web browser without supplying the password using the following form of URL:<pre>\n    http://site.example.com/admin/cron.php?password=opensesame\n</pre>If this is left empty, no password is required.', 'Esto significa que el script cron.php no puede ejecutarse desde un navegador web sin suministrar la contrasea usando la siguiente formato para la URL:<pre>http://site.example.com/admin/cron.php?password=opensesame\n</pre>Si se deja vaco, no se necesita contrasea.', null, '1472076014', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1947', 'es', '3', 'configcurlcache', 'Time-to-live for cURL cache, in seconds.', 'Tiempo de vigencia (en segundos) de la cach cURL.', null, '1472076014', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1948', 'es', '3', 'configcustommenuitems', 'You can configure a custom menu here to be shown by themes. Each line consists of some menu text, a link URL (optional), a tooltip title (optional) and a language code or comma-separated list of codes (optional, for displaying the line to users of the specified language only), separated by pipe characters. You can specify a structure using hyphens, and dividers can be used by adding a line of one or more # characters where desired. For example:\n<pre>\nMoodle community|https://moodle.org\n-Moodle free support|https://moodle.org/support\n-###\n-Moodle development|https://moodle.org/development\n--Moodle Docs|http://docs.moodle.org|Moodle Docs\n--German Moodle Docs|http://docs.moodle.org/de|Documentation in German|de\n#####\nMoodle.com|http://moodle.com/\n</pre>', 'Puede disear un men personalizado que se mostrar en las plantillas. Cada lnea consta de un texto del men, un enlace URL (opcional), una descripcin del ttulo (opcional), y un cdigo de idioma o una serie de cdigos separados por comas (opcional, para mostrar la lnea del men solamente a los usuarios del idioma indicado), separados por la lnea horizontal | (AltGr + 1). Puede especificar una estructura de submens haciendo uso de guiones, y los separadores pueden ser usados aadiendo una lnea con uno o ms smbolos # cuando se desee. Por ejemplo:\n<pre>\nComunidad Moodle|https://moodle.org\n-Soporte gratuito de Moodle |https://moodle.org/support\n-###\n-Desarrollo de Moodle|https://moodle.org/development\n--Documentacin de Moodle|http://docs.moodle.org|Documentacin de Moodle\n--Documentacin Alemn de Moodle|http://docs.moodle.org/de|Documentacin en Alemn|de\n#####\nMoodle.com|http://moodle.com/\n</pre>', null, '1472076014', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1949', 'es', '3', 'configcustomusermenuitems', 'You can configure the contents of the user menu (with the exception of the log out link, which is automatically added). Each line is separated by | characters and consists of 1) a string in \"langstringname, componentname\" form or as plain text, 2) a URL, and 3) an icon either as a pix icon or as a URL. Dividers can be used by adding a line of one or more # characters where desired.', 'Puede configurar los contenidos del men de usuario (con la excepcin del enlace de salir, el cual es automticamente aadido). Cada lnea se separa por carcteres | y consiste en 1) una cadena con el formato \"langstringname, componentname\" o como texto plano, 2) una URL, y 3) un icono bien un icono pix o como una URL. Los separadores pueden ser utilizados para aadir una lnea o ms carcteres # donde se desee.', null, '1472076014', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1950', 'es', '3', 'configdbsessions', 'If enabled, this setting will use the database to store information about current sessions. Note that changing this setting now will log out all current users (including you). If you are using MySQL please make sure that \'max_allowed_packet\' in my.cnf (or my.ini) is at least 4M. Other session drivers can be configured directly in config.php, see config-dist.php for more information. This option disappears if you specify session driver in config.php file.', 'Si elige esta opcin, se usar la base de datos para almacenar informacin sobre las sesiones actuales. Tenga en cuenta que la modificacin de este ajuste desconectar a todos los usuarios (includo usted). Si est utilizando MySQL por favor confirme que la opcin \'max_allowed_packet\' en my.cnf (o my.ini) es de por lo menos 4M. Otros drivers de sesin pueden ser configurados directamente en config.php, lea el fichero config-dist.php para ms informacin. Esta opcin desaparece si usted especifica un driver de sesin en el fichero config.php.', null, '1472076014', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1951', 'es', '3', 'configdebug', 'If you turn this on, then PHP\'s error_reporting will be increased so that more warnings are printed.  This is only useful for developers.', 'Si activa esta opcin, se incrementar el error_reporting de PHP, de modo que recibir ms advertencias. Slo resulta til para los desarrolladores.', null, '1472076014', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1952', 'es', '3', 'configdebugdisplay', 'Set to on, the error reporting will go to the HTML page. This is practical, but breaks XHTML, JS, cookies and HTTP headers in general. Set to off, it will send the output to your server logs, allowing better debugging. The PHP setting error_log controls which log this goes to.', 'Si activa esta opcin, el informe de errores ir a la pgina HTML. Es prctico pero rompe XHTML, JS, \'cookies\' y cabeceras HTTP en general. Si deshabilita esta opcin, se enviarn las salidas a los registros del servidor, permitiendo una mejor depuracin. El parmetro de configuracin de PHP <b>error_log</b>controla a qu registro va el error.', null, '1472076014', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1953', 'es', '3', 'configdebugpageinfo', 'Enable if you want page information printed in page footer.', 'Habiltelo si desea que la informacin de la pgina aparezca en el pie de pgina.', null, '1472076014', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1954', 'es', '3', 'configdebugsmtp', 'Enable verbose debug information during sending of email messages to SMTP server.', 'Activa la depuracin con informacin detallada durante el envo de correos electrnicos al servidor SMTP.', null, '1472076015', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1955', 'es', '3', 'configdebugvalidators', 'Enable if you want to have links to external validator servers in page footer. You may need to create new user with username <em>w3cvalidator</em>, and enable guest access. These changes may allow unauthorized access to server, do not enable on production sites!', 'Activar si quiere disponer de enlaces a servidores externos de validacin a pie de pgina. Es posible que necesite crear un nuevo usuario con nombre de usuario <em>w3cvalidator</em>, y permitir el acceso de invitados. Estos cambios pueden facilitar el acceso no autorizado al servidor, no lo hago en los sitios de produccin!', null, '1472076015', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1956', 'es', '3', 'configdefaulthomepage', 'This determines the home page for logged in users', 'Determina cul ser la pgina principal para los usuarios identificados', null, '1472076015', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1957', 'es', '3', 'configdefaultrequestcategory', 'Courses requested by users will be automatically placed in this category.', 'Los cursos solicitados por los usuarios sern ubicados automticamente en esta categora.', null, '1472076015', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1958', 'es', '3', 'configdefaultrequestedcategory', 'Default category to put courses that were requested into, if they\'re approved.', 'Categora por defecto en la que incluir los cursos solicitados, en el caso de que sean aprobados.', null, '1472076015', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1959', 'es', '3', 'configdefaultuserroleid', 'All logged in users will be given the capabilities of the role you specify here, at the site level, in ADDITION to any other roles they may have been given.  The default is the Authenticated user role.  Note that this will not conflict with other roles they have unless you prohibit capabilities, it just ensures that all users have capabilities that are not assignable at the course level (eg post blog entries, manage own calendar, etc).', 'A todos los usuarios identificados se les asignarn los permisos del rol que usted especifique aqu, en el nivel del sitio, ADEMS de cualesquiera otros roles que puedan tener. El rol por defecto es el de Usuario identificado. Advierta que esto no entrar en conflicto con otros roles que tengan a menos que prohiba permisos. Simplemente asegura que todos los usuarios tengan permisos que no son asignables a nivel de curso (e.g., enviar entradas al blog, gestionar su propio calendario, etc.).', null, '1472076015', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1960', 'es', '3', 'configdeleteincompleteusers', 'After this period, old not fully setup accounts are deleted.', 'Despus de este perodo se eliminarn todas las cuentas no ajustadas completamente.', null, '1472076015', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1961', 'es', '3', 'configdeleteunconfirmed', 'If you are using email authentication, this is the period within which a response will be accepted from users.  After this period, old unconfirmed accounts are deleted.', 'Si est usando una identificacin basada en email, ste es el perodo dentro del cual se aceptar una respuesta enviada por los usuarios. Pasado ese perodo, se eliminarn todas las cuentas no confirmadas.', null, '1472076015', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1962', 'es', '3', 'configdenyemailaddresses', 'To deny email addresses from particular domains list them here in the same way.  All other domains will be accepted. To deny subdomains add the domain with a preceding \'.\'. eg <strong>hotmail.com yahoo.co.uk .live.com</strong>', 'Para denegar direcciones de email de dominios particulares, escriba aqu una lista de ellos. El resto de los dominios sern aceptados. Para denegar subdominios escriba el dominio precedido por un punto \'.\' Por ejemplo, <strong>hotmail.com (para dominios) .yahoo.es (para los subdominios)</strong>', null, '1472076015', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1963', 'es', '3', 'configenableblogs', 'This switch provides all site users with their own blog.', 'Esta configuracin les proporciona a todos los usuarios su propio blog.', null, '1472076015', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1964', 'es', '3', 'configenabledevicedetection', 'Enables detection of mobiles, smartphones, tablets or default devices (desktop PCs, laptops, etc) for the application of themes and other features.', 'Permite la deteccin de telfonos mviles, mviles inteligentes, tabletas o dispositivos por defecto (PC de escritorio, PC porttil, etc.) para la aplicacin de temas u otras caractersticas.', null, '1472076016', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1965', 'es', '3', 'configdisableuserimages', 'Disable the ability for users to change user profile images.', 'Desactiva la posibilidad de que los usuarios cambien las imgenes de sus perfiles.', null, '1472076016', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1966', 'es', '3', 'configdisplayloginfailures', 'This will display information to users about previous failed logins.', 'Mostrar informacin a los usuarios sobre los anteriores intentos de identificacin  fallidos.', null, '1472076016', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1967', 'es', '3', 'configdndallowtextandlinks', 'Enable or disable the dragging and dropping of text and links onto a course page, alongside the dragging and dropping of files. Note that the dragging of text into Firefox or between different browsers is unreliable and may result in no data being uploaded, or corrupted text being uploaded.', 'Activar o desactivar la funcin \"Arrastrar y Soltar\" en una pgina del curso, para texto y enlaces, adems de para archivos. Tenga en cuenta que el arrastre de texto en Firefox, o entre diferentes navegadores no es fiable y puede dar lugar a que no se suba ningn dato o que el texto subido est corrupto.', null, '1472076016', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1968', 'es', '3', 'configdoclang', 'This language will be used in links for the documentation pages.', 'Este idioma se puede utilizar en enlaces para las pginas de documentacin.', null, '1472076016', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1969', 'es', '3', 'configdocroot', 'Defines the path to the Moodle Docs for providing context-specific documentation via \'Moodle Docs for this page\' links in the footer of each page. If the field is left blank, links will not be displayed.', 'Define la ruta a Moodle Docs. Puede cambiar esta opcin si desea tener su propia documentacin personalizada en lnea. No obstante, si lo hace as, asegrese de que las rutas de su documentacin siguen el mismo formato que http://docs.moodle.org', null, '1472076016', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1970', 'es', '3', 'configdoctonewwindow', 'If you enable this, then links to Moodle Docs will be shown in a new window.', 'Si habilita esta opcin los enlaces a Moodle Docs se mostrarn en una nueva ventana.', null, '1472076016', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1971', 'es', '3', 'configeditordictionary', 'This value will be used if aspell doesn\'t have dictionary for users own language.', 'Este valor ser usado si el corrector de ortografa no tiene un diccionario para el idioma propio de los usuarios.', null, '1472076016', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1972', 'es', '3', 'configeditorfontlist', 'Select the fonts that should appear in the editor\'s drop-down list.', 'Seleccione las fuentes que deberan aparecer en la lista del men emergente del editor.', null, '1472076016', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1973', 'es', '3', 'configemailchangeconfirmation', 'Require an email confirmation step when users change their email address in their profile.', 'Cuando los usuarios cambien su direccin de correo electrnico en sus perfiles de usuario, se requerir confirmacin del correo electrnico.', null, '1472076016', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1974', 'es', '3', 'configenablecalendarexport', 'Enable exporting or subscribing to calendars.', 'Habilitar la exportacin o suscripcin a los calendarios.', null, '1472076016', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1975', 'es', '3', 'configenablecomments', 'Enable comments', 'Habilitar comentarios', null, '1472076016', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1976', 'es', '3', 'configenablecourserequests', 'This will allow any user to request a course be created.', 'Permite que cualquier usuario solicite la creacin de un curso.', null, '1472076016', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1977', 'es', '3', 'configenablemobilewebservice', 'Enable mobile service for the official Moodle app or other app requesting it. For more information, read the {$a}', 'Habilitar el servicio para mviles para la aplicacin oficial Moodle u otra aplicacin que lo solicite. Para ms informacin lea la {$a}', null, '1472076016', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1978', 'es', '3', 'configenablerssfeeds', 'If enabled, RSS feeds are generated by various features across the site, such as blogs, forums, database activities and glossaries. Note that RSS feeds also need to be enabled for the particular activity modules.', 'Esta opcin habilita el acceso a canales RSS. Para ver cualquier cambio es necesario tambin activar los canales RSS en los mdulos individuales (vaya a los ajustes de Mdulos en Admin - Configuracin).', null, '1472076016', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1979', 'es', '3', 'configenablerssfeedsdisabled', 'It is not available because RSS feeds are disabled in all the Site. To enable them, go to the Variables settings under Admin Configuration.', 'No est disponible porque los canales RSS estn desactivados en todo el sitio. Para activarlos, vaya a Variables en Admin - Configuracin.', null, '1472076017', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1980', 'es', '3', 'configenablerssfeedsdisabled2', 'RSS feeds are disabled at the server level. You need to enable them first in Server/RSS.', 'Los canales RSS estn deshabilitados en el nivel servidfor. Para activarlos, vaya a los ajustes de las Variables en Configuracin -> Administracin.', null, '1472076017', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1981', 'es', '3', 'configenablesafebrowserintegration', 'This adds the choice \'Require Safe Exam Browser\' to the \'Browser security\' field on the quiz settings form. See http://www.safeexambrowser.org/ for more information.', 'Agrega la opcin \"Requerir  Examen Seguro del Navegador\" para el campo \"Seguridad del navegador \"en el formulario de configuracin del cuestionario. Ver http://www.safeexambrowser.org/ para ms informacin.', null, '1472076017', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1982', 'es', '3', 'configenablestats', 'If you choose \'yes\' here, Moodle\'s cronjob will process the logs and gather some statistics.  Depending on the amount of traffic on your site, this can take awhile. If you enable this, you will be able to see some interesting graphs and statistics about each of your courses, or on a sitewide basis.', 'Si selecciona \'s\', el cronjob de Moodle procesar los registros y recopilar algunas estadsticas. Dependiendo de la cantidad de trfico del sitio, esta operacin puede demorarse. Si activa esta opcin, podr ver algunos grficos y estadsticas interesantes sobre cada uno de sus cursos, o bien sobre todo el sitio.', null, '1472076017', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1983', 'es', '3', 'configenabletrusttext', 'By default Moodle will always thoroughly clean text that comes from users to remove any possible bad scripts, media etc that could be a security risk.  The Trusted Content system is a way of giving particular users that you trust the ability to include these advanced features in their content without interference.  To enable this system, you need to first enable this setting, and then grant the Trusted Content permission to a specific Moodle role.  Texts created or uploaded by such users will be marked as trusted and will not be cleaned before display.', 'Por defecto, Moodle limpiar siempre a fondo el texto escrito por los usuarios a fin de eliminar cualesquiera \'scripts\', medios, etc., que pudieran constituir un riesgo para la seguridad. El sistema de contenido confiable es una forma de otorgar a determinados usuarios en los que usted confa la capacidad para incluir estas caractersticas avanzadas en su contenido sin interferencias. Para activar este sistema, necesita en primer lugar activar este ajuste, y luego otorgar permiso de Contenido confiable a un rol especfico de Moodle. Los textos creados o subidos por tales usuarios sern marcados como confiables y no sern sometidos a limipieza antes de ser mostrados.', null, '1472076017', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1984', 'es', '3', 'configenablewebservices', 'Web services enable other systems to log in to this Moodle and perform operations.  For extra security this feature should be disabled unless you are really using it.', 'Los servicios Web permiten otros sistemas para acceder a este Moodle y realizar operaciones. Para mayor seguridad esta caracterstica debe ser desactivada a menos que realmente la est utilizando.', null, '1472076017', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1985', 'es', '3', 'configenablewsdocumentation', 'Enable auto-generation of web services documentation. A user can access to his own documentation on his security keys page {$a}. It displays the documentation for the enabled protocols only.', 'Habilitar la auto-generacin de documentacin de servicios web. Un usuario puede tener acceso a su propia documentacin en su pgina de claves de seguridad {$a}. Solo se muestra la documentacin de los protocolos habilitados.', null, '1472076017', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1986', 'es', '3', 'configerrorlevel', 'Choose the amount of PHP warnings that you want to be displayed.  Normal is usually the best choice.', 'Seleccionar la cantidad de advertencias PHP que desea mostrar. La mejor eleccin es \'Normal\'.', null, '1472076017', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1987', 'es', '3', 'configexportlookahead', 'Days to look ahead during export', 'Das a mirar hacia adelante durante la exportacin', null, '1472076017', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1988', 'es', '3', 'configexportlookback', 'Days to look back during export', 'Das a mirar hacia atrs durante la exportacin', null, '1472076017', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1989', 'es', '3', 'configextendedusernamechars', 'Enable this setting to allow students to use any characters in their usernames (note this does not affect their actual names).  The default is \"false\" which restricts usernames to be alphanumeric lowercase characters, underscore (_), hyphen (-), period (.) or at symbol (@).', 'Este ajuste permite a los estudiantes usar cualesquiera caracteres en sus nombres de usuario (note que eso no afecta a sus nombres reales). El valor por defecto es \"false\", lo que restringe los nombres de usuario a caracteres alfanumricos en minsculas, guin bajo (_), guin (-), smbolo de perodo o de arroba (@) (.).', null, '1472076018', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1990', 'es', '3', 'configextramemorylimit', 'Some scripts like search, backup/restore or cron require more memory. Set higher values for large sites.', 'Algunas secuencias de comandos como bsqueda, copia de seguridad / restaurar o cron requieren ms memoria. Establezca valores ms altos para los sitios grandes.', null, '1472076018', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1991', 'es', '3', 'configfilterall', 'Filter all strings, including headings, titles, navigation bar and so on.  This is mostly useful when using the multilang filter, otherwise it will just create extra load on your site for little gain.', 'Filtrar todas las cadenas, incluyendo cabeceras, ttulos, barra de navegacin, etc. Esto resulta muy til cuando se usa el filtro multi-idioma; de otro modo, nicamente se ocasionar una sobrecarga en el sitio para obtener escasas ganancias.', null, '1472076018', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1992', 'es', '3', 'configfiltermatchoneperpage', 'Automatic linking filters will only generate a single link for the first matching text instance found on the complete page. All others are ignored.', 'Los filtros de enlace automtico slo generarn un enlace nico al primer ejemplo de texto coincidente que se encuentre en la pgina completa, pasando por alto el resto.', null, '1472076018', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1993', 'es', '3', 'configfiltermatchonepertext', 'Automatic linking filters will only generate a single link for the first matching text instance found in each item of text (e.g., resource, block) on the page. All others are ignored. This setting is ignored if the one per page setting is <i>yes</i>.', 'Los filtros de enlace automtico slo generarn un enlace nico al primer ejemplo de texto coincidente que se encuentre en cada elemento de texto (e.g., recurso, bloque) de la pgina, pasando por alto el resto. Este ajuste no se tendr en cuenta si el nico ajuste por pgina es <i>s</i>.', null, '1472076018', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1994', 'es', '3', 'configfilteruploadedfiles', 'Process all uploaded HTML and text files with the filters before displaying them, only uploaded HTML files or none at all.', 'Esta opcin posibilita que Moodle procese con los filtros todos los archivos HTML y de texto subidos antes de mostrarlos.', null, '1472076018', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1995', 'es', '3', 'configforcelogin', 'Normally, the front page of the site and the course listings (but not courses) can be read by people without logging in to the site.  If you want to force people to log in before they do ANYTHING on the site, then you should enable this setting.', 'Normalmente la pgina principal del sitio y las listas de los cursos (pero no los cursos) pueden ser ledos por cualquiera sin necesidad de escribir su nombre de usuario y contrasea. Si desea forzar a los visitantes a acceder al sitio antes de poder ver CUALQUIER CONTENIDO, debera activar esta opcin.', null, '1472076018', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1996', 'es', '3', 'configforceloginforprofiles', 'This setting forces people to log in as a real (non-guest) account before viewing any user\'s profile. If you disabled this setting, you may find that some users post advertising (spam) or other inappropriate content in their profiles, which is then visible to the whole world.', 'Esta opcin obliga a acceder al sitio con cuentas vlidas (no como invitados) antes de poder ver las pginas de los perfiles de usuario. Si deshabilita esta opcin puede darse el caso de que algunos usuarios publiquen anuncios (spam) u otro contenido inapropiado en sus perfiles y este contenido ser visible para todo el mundo.', null, '1472076018', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1997', 'es', '3', 'configfrontpage', 'The items selected above will be displayed on the site\'s front page.', 'Los elementos seleccionados se mostrarn en la pgina principal del sitio.', null, '1472076018', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1998', 'es', '3', 'configfrontpagecourselimit', 'Maximum number of courses', 'Nmero mximo de cursos', null, '1472076018', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1999', 'es', '3', 'configfrontpagecourselimithelp', 'Maximum number of courses to be displayed on the site\'s front page in course listings.', 'Nmero mximo de cursos que se mostrar en la pgina principal del sitio en los listados de cursos.', null, '1472076018', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2000', 'es', '3', 'configfrontpageloggedin', 'The items selected above will be displayed on the site\'s front page when a user is logged in.', 'Los elementos seleccionados se mostrarn en la portada del sitio cuando un usuario se identifica.', null, '1472076018', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2001', 'es', '3', 'configfullnamedisplay', 'This defines how names are shown when they are displayed in full. The default value, \"language\", leaves it to the string \"fullnamedisplay\" in the current language pack to decide. Some languages have different name display conventions.\n\nFor most mono-lingual sites the most efficient setting is \"firstname lastname\", but you may choose to hide surnames altogether. Placeholders that can be used are: firstname, lastname, firstnamephonetic, lastnamephonetic, middlename, and alternatename.', 'Esta opcin define cmo se vern los nombres cuando se muestren completos. Para la mayora de los sitios que usen un solo idioma el ajuste ms eficiente es el valor por defecto (\"Nombre + Apellido\"), pero puede elegir ocultar los apellidos, o dejar que sea el paquete de idioma actual quien decida (algunos idiomas usan reglas diferentes).', null, '1472076019', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2002', 'es', '3', 'configgeoipfile', 'Location of GeoIP City binary data file. This file is not part of Moodle distribution and must be obtained separately from <a href=\"http://www.maxmind.com/\">MaxMind</a>. You can either buy a commercial version or use the free version. Simply download <a href=\"http://geolite.maxmind.com/download/geoip/database/GeoLiteCity.dat.gz\" >http://geolite.maxmind.com/download/geoip/database/GeoLiteCity.dat.gz</a> and extract it into \"{$a}\" directory on your server.', 'Ubicacin del archivo binario GeoIP City. Este archivo no forma parte de la distribucin de Moodle y debe obtenerse de forma independiente en <a href=\"http://www.maxmind.com/\">MaxMind</a>. Puede adquirir una versin comercial u optar por la versin gratuita.<br />Simplemente descargue <a href=\"http://geolite.maxmind.com/download/geoip/database/GeoLiteCity.dat.gz\" >http://geolite.maxmind.com/download/geoip/database/GeoLiteCity.dat.gz</a> y extrigalo en el directorio \"{$a}\" de su servidor.', null, '1472076019', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2003', 'es', '3', 'configgetremoteaddrconf', 'If your server is behind a reverse proxy, you can use this setting to specify which HTTP headers can be trusted to contain the remote IP address. The headers are read in order, using the first one that is available.', 'Si su servidor est detrs de un \'reverse proxy\', puede usar esta opcin para especificar en qu cabeceras HTTP se puede confiar que contengan la direccin IP remota. Las cabeceras se leen por orden, usando la primera que est disponible.', null, '1472076019', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2004', 'es', '3', 'configgradebookroles', 'This setting allows you to control who appears on the gradebook.  Users need to have at least one of these roles in a course to be shown in the gradebook for that course.', 'Esta opcin le permite controlar quin aparece en el libro de calificaciones. Los usuarios necesitan tener al menos uno de estos roles en un curso para poder aparecer en el libro de calificaciones de ese curso.', null, '1472076019', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2005', 'es', '3', 'configgradeexport', 'Choose which gradebook export formats are your primary methods for exporting grades.  Chosen plugins will then set and use a \"last exported\" field for every grade.  For example, this might result in exported records being identified as being \"new\" or \"updated\".  If you are not sure about this then leave everything unchecked.', 'Elija qu formatos de exportacin del libro de calificaciones constituyen su mtodo principal para exportar calificaciones. Los conectores elegidos ajustarn y usarn un campo (\"ltimos exportados\") para cada calificacin. Por ejemplo, esto podra dar como resultado que los registros exportados se identificaran como \"nuevos\" o \"actualizados\". Si no est seguro de cmo hacer esto, no marque nada.', null, '1472076019', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2006', 'es', '3', 'confighiddenuserfields', 'Select which user information fields you wish to hide from other users other than course teachers/admins. This will increase student privacy. Hold CTRL key to select multiple fields.', 'Para aumentar la privacidad de los estudiantes, seleccione qu campos de informacin sobre el usuario desea ocultar a otros usuarios distintos de los profesores del curso o los administradores. Mantenga pulsada la tecla CTRL para seleccionar varios campos.', null, '1472076019', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2007', 'es', '3', 'configidnumber', 'This option specifies whether (a) Users are not be asked for an ID number at all, (b) Users are asked for an ID number but can leave it blank or (c) Users are asked for an ID Number and cannot leave it blank. If given the User\'s ID number is displayed in their Profile.', 'Esta opcin especifica si (a) No se pide a los usuarios un nmero de ID, (b) Se les pide un nmero de ID pero pueden dejarlo en blanco o (c) Se les pide un nmero de ID y no pueden dejarlo en blanco. En caso afirmativo, el nmero de ID del Usuario se muestra en su Perfil.', null, '1472076019', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2008', 'es', '3', 'configintro', 'On this page you can specify a number of configuration variables that help make Moodle work properly on your server.  Don\'t worry too much about it - the defaults will usually work fine and you can always come back to this page later and change these settings.', 'En esta pgina puede especificar un nmero de variables de configuracin que ayudan a Moodle a trabajar adecuadamente en su servidor. Que esto no le preocupe demasiado: los valores por defecto funcionarn bien y, en todo caso, siempre podr volver a esta pgina y cambiar los ajustes.', null, '1472076019', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2009', 'es', '3', 'configintroadmin', 'On this page you should configure your main administrator account which will have complete control over the site. Make sure you give it a secure username and password as well as a valid email address.  You can create more admin accounts later on.', 'En esta pgina debera configurar su cuenta de administrador principal, que le dar un control absoluto sobre el sitio. Asegrese de que usa un nombre de usuario y contrasea seguros, as como una direccin de correo electrnico vlida. Ms adelante podr crear ms cuentas de administrador.', null, '1472076019', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2010', 'es', '3', 'configintrosite', 'This page allows you to configure the front page and name of this new site.  You can come back here later to change these settings any time using the Administration menus.', 'Esta pgina le permite configurar la pgina principal y dar un nombre a su nuevo sitio. Puede volver aqu ms adelante y cambiar estos ajustes en cualquier momento usando los mens de Administracin.', null, '1472076019', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2011', 'es', '3', 'configiplookup', 'When you click on an IP address (such as 34.12.222.93), such as in the logs, you are shown a map with a best guess of where that IP is located.  There are different plugins for this that you can choose from, each has benefits and disadvantages.', 'Cuando usted hace clic en una direccin IP (e.g., 34.12.222.93), como sucede en los registros, se mostrar un mapa con la mejor aproximacin posible de la ubicacin de la IP. Para hacer esto, existen diferentes \'plugins\' entre los que puede elegir, y cada uno de ellos tiene ventajas e inconvenientes.', null, '1472076019', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2012', 'es', '3', 'configkeeptagnamecase', 'Check this if you want tag names to keep the original casing as entered by users who created them', 'Marque esta opcin si desea que los nombres de marca conserven el \'casing\' original tal como fue introducido por los usuarios que los crearon.', null, '1472076020', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2013', 'es', '3', 'configlang', 'Choose a default language for the whole site. Users can override this setting using the language menu or the setting in their personal profile.', 'Elija un idioma por defecto para el sitio completo. Los usuarios pueden ms tarde elegir otra opcin en el men de idiomas o en su perfil personal.', null, '1472076020', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2014', 'es', '3', 'configlangstringcache', 'Caches all the language strings into compiled files in the data directory.  If you are translating Moodle or changing strings in the Moodle source code then you may want to switch this off.  Otherwise leave it on to see performance benefits.', 'Guarda en la cach todas las cadenas del idioma en archivos compilados dentro del directorio de datos. Si est traduciendo Moodle o cambiando cadenas en el cdigo fuente de Moodle entonces puede desactivar esto. De lo contrario, djelo activo en beneficio del rendimiento.', null, '1472076020', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2015', 'es', '3', 'configlanglist', 'Leave this blank to allow users to choose from any language you have in this installation of Moodle.  However, you can shorten the language menu by entering a comma-separated list of language codes that you want.  For example:  en,es_es,fr,it', 'Deje esto en blanco para dejar que los usuarios elijan cualquier idioma presente en la instalacin de Moodle. Sin embargo, puede acortar el men escribiendo una lista de cdigos de los idiomas que desee separada por comas. Por ejemplo, en,es_es,fr,it', null, '1472076020', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2016', 'es', '3', 'configlangmenu', 'Choose whether or not you want to display the general-purpose language menu on the home page, login page etc.  This does not affect the user\'s ability to set the preferred language in their own profile.', 'Decida si quiere o no mostrar el men de idiomas de propsito general en la pgina de inicio, en la de acceso, etc. Esto no afecta a la posibilidad que los usuarios tienen de elegir su idioma preferido en su propio perfil.', null, '1472076020', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2017', 'es', '3', 'configlatinexcelexport', 'Choose the encoding for Excel exports.', 'Elegir la codificacin para exportaciones en formato Excel.', null, '1472076020', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2018', 'es', '3', 'configlocale', 'Choose a sitewide locale - this will override the format and language of dates for all language packs (though names of days in calendar are not affected). You need to have this locale data installed on your operating system (eg for linux en_US.UTF-8 or es_ES.UTF-8). In most cases this field should be left blank.', 'Elija una localizacin para el sitio. Esta localizacin tendr preferencia sobre todos los paquetes de idiomas a la hora de elegir el formato y el lenguaje de las fechas (aunque los nombres de los das en el calendario no se vern afectados). Necesita tener estos datos de localizacin instalados en su sistema operativo (e.g., en linux en_US.UTF8 o es_ES.UTF8). En la mayora de los casos debera dejar este campo en blanco.', null, '1472076020', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2019', 'es', '3', 'configloginhttps', 'Turning this on will make Moodle use a secure https connection just for the login page (providing a secure login), and then afterwards revert back to the normal http URL for general speed.  CAUTION: this setting REQUIRES https to be specifically enabled on the web server - if it is not then YOU COULD LOCK YOURSELF OUT OF YOUR SITE.', 'Esta opcin hace que Moodle use una conexin https segura en la pgina de acceso (proporcionando un acceso seguro) para volver luego a la URL http normal. PRECAUCIN: esta opcin REQUIERE que el https est habilitado especficamente en el servidor web. En caso contrario, USTED MISMO SER EXPULSADO DEL SITIO.', null, '1472076020', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2020', 'es', '3', 'configloglifetime', 'This specifies the length of time you want to keep logs about user activity.  Logs that are older than this age are automatically deleted.  It is best to keep logs as long as possible, in case you need them, but if you have a very busy server and are experiencing performance problems, then you may want to lower the log lifetime. Values lower than 30 are not recommended because statistics may not work properly.', 'Esta opcin especifica durante cunto tiempo desea conservar los registros de actividad de cada usuario. Los registros anteriores sern eliminados. Es mejor que la cifra sea alta (por si los necesita) pero si el servidor est muy ocupado y hay problemas de funcionamiento, tal vez convenga acortar el tiempo. No se recomiendan valores menores de 30 porque en ese caso puede que las estadsticas no funcionen correctamente.', null, '1472076020', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2021', 'es', '3', 'configlookahead', 'Days to look ahead', 'Das de previsin...', null, '1472076020', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2022', 'es', '3', 'configmaxbytes', 'This specifies a maximum size that uploaded files can be throughout the whole site. This setting is limited by the PHP settings post_max_size and upload_max_filesize, as well as the Apache setting LimitRequestBody. In turn, maxbytes limits the range of sizes that can be chosen at course level or module level. If \'Server Limit\' is chosen, the server maximum allowed by the server will be used.', 'Esta opcin especifica el tamao mximo que deben tener los archivos subidos al sitio. Est limitada por los ajustes post_max_size y upload_max_size de  PHP y por el ajuste LimitRequestBody de Apache. A su vez, la opcin limita el rango de tamaos que pueden elegirse en el nivel de curso o de mdulo. Si se elige la opcin \'Lmite de Servidor\' se usar el mximo permitido por el servidor.', null, '1472076020', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2023', 'es', '3', 'configmaxconsecutiveidentchars', 'Passwords must not have more than this number of consecutive identical characters. Use 0 to disable this check.', 'Las contraseas no deben tener ms de este nmero de caracteres idnticos consecutivos. Utilice el 0 para deshabilitar esta comprobacin.', null, '1472076020', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2024', 'es', '3', 'configmaxeditingtime', 'This specifies the amount of time people have to re-edit forum postings, glossary comments etc.  Usually 30 minutes is a good value.', 'Esta opcin especifica cunto tiempo tienen los usuarios para reeditar los mensajes enviados al foro, el feedback del diario, etc. Normalmente 30 minutos es un valor adecuado.', null, '1472076021', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2025', 'es', '3', 'configmaxevents', 'Events to Lookahead', 'Eventos de previsin', null, '1472076021', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2026', 'es', '3', 'configmessaging', 'Should the messaging system between site users be enabled?', 'Desea habilitar el sistema de mensajera entre los usuarios del sitio?', null, '1472076021', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2027', 'es', '3', 'configmessagingallowemailoverride', 'Allow users to have email message notifications sent to an email address other than the email address in their profile', 'Permitir a los usuarios recibir notificaciones de mensajes de correo enviados a una direccin de correo electrnico distinta de la direccin de correo electrnico en su perfil', null, '1472076021', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2028', 'es', '3', 'configmessaginghidereadnotifications', 'Hide read notifications of events like forum posts when viewing messaging history', 'Ocultar las notificaciones ya ledas, como las aportaciones a los foros, cuando est viendo el historial de mensajes', null, '1472076021', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2029', 'es', '3', 'configmessagingdeletereadnotificationsdelay', 'Read notifications can be deleted to save space. How long after a notification is read can it be deleted?', 'Las notificaciones ya ledas pueden borrarse para ahorrar espacio. Al cabo de canto tiempo despus de ser leda puede borrarse?', null, '1472076021', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2030', 'es', '3', 'configminpassworddigits', 'Passwords must have at least these many digits.', 'Las contraseas deben tener al menos estos dgitos.', null, '1472076021', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2031', 'es', '3', 'configminpasswordlength', 'Passwords must be at least these many characters long.', 'Las contraseas deben tener al menos este nmero de caracteres.', null, '1472076021', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2032', 'es', '3', 'configminpasswordlower', 'Passwords must have at least these many lower case letters.', 'Las contraseas deben tener al menos este nmero de minsculas.', null, '1472076021', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2033', 'es', '3', 'configminpasswordnonalphanum', 'Passwords must have at least these many non-alphanumeric characters.', 'Las contraseas deben tener al menos este nmero de caracteres no alfanumricos.', null, '1472076021', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2034', 'es', '3', 'configminpasswordupper', 'Passwords must have at least these many upper case letters.', 'Las contraseas deben tener al menos este nmero de maysculas.', null, '1472076021', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2035', 'es', '3', 'configmobilecssurl', 'A CSS file to customise your mobile app interface.', 'Archivo CSS para personalizar su interfaz de aplicaciones mviles.', null, '1472076021', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2036', 'es', '3', 'configmodchooserdefault', 'Should the activity chooser be presented to users by default?', 'Se presentar por defecto a los usuarios el selector de actividad?', null, '1472076021', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2037', 'es', '3', 'configmycoursesperpage', 'Maximum number of courses to display in any list of a user\'s own courses', 'Nmero mximo de cursos que se mostrar en cualquier lista de cursos propios de un usuario', null, '1472076021', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2038', 'es', '3', 'configmymoodleredirect', 'This setting forces redirects to /my on login for non-admins and replaces the top level site navigation with /my', 'Esta opcin fuerza a los no administradores a dirigirse a /my al ingresar y reemplaza la navegacin de nivel superior del sitio con /my', null, '1472076021', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2039', 'es', '3', 'configmypagelocked', 'This setting prevents the default page from being edited by any non-admins', 'Este ajuste impide que la pgina por defecto sea editada por cualquiera que no sea administrador', null, '1472076022', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2040', 'es', '3', 'confignavcourselimit', 'Limits the number of courses shown to the user when they are either not logged in or are not enrolled in any courses.', 'Limita el nmero de cursos mostrados al usuario cuando an no se ha registrado o no se ha matriculado en ningn curso.', null, '1472076022', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2041', 'es', '3', 'confignavshowallcourses', 'This setting determines whether users who are enrolled in courses can see Courses (listing all courses) in the navigation, in addition to My Courses (listing courses in which they are enrolled).', 'Si est habilitada los usuarios vern los cursos en los que estn matriculados tanto en \"Mis cursos\" como en la estructura de cursos. Si est deshabilitada los usuarios solo los vern en la opcin \"Mis cursos\" del men de navegacin.', null, '1472076022', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2042', 'es', '3', 'confignavshowcategories', 'Show course categories in the navigation bar and navigation blocks. This does not occur with courses the user is currently enrolled in, they will still be listed under mycourses without categories.', '<p>Mostrar las categoras de curso en la barra de navegacin y en los bloques de navegacin. </p>\n<p>No afecta a los cursos en los que el usuario est actualmente matriculado, de manera que todava aparecern en la lista \'Mis cursos\' sin categoras.</p>', null, '1472076022', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2043', 'es', '3', 'confignotifyloginfailures', 'Send login failure notification messages to these selected users. This requires an internal logstore (eg Standard Logstore) to be enabled.', 'Si los intentos de acceso fallidos han sido registrados, pueden enviarse notificaciones mediante correo electrnico. Quin debera ver estas notificaciones?', null, '1472076022', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2044', 'es', '3', 'confignotifyloginthreshold', 'If notifications about failed logins are active, how many failed login attempts by one user or one IP address is it worth notifying about?', 'Si las notificaciones de intentos de identificacin fallidos estn activas, cuntos intentos fallidos son necesarios para enviar una notificacin al respecto a un usuario o a una direccin IP?', null, '1472076022', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2045', 'es', '3', 'confignotloggedinroleid', 'Users who are not logged in to the site will be treated as if they have this role granted to them at the site context.  Guest is almost always what you want here, but you might want to create roles that are less or more restrictive.  Things like creating posts still require the user to log in properly.', 'Los usuarios que no estn identificados en el sitio sern tratados como si tuvieran este rol en el contexto del sitio. \'Invitado\' es aqu casi siempre lo que usted quiera, pero quizs desee crear roles que sean ms o menos restrictivos. Cosas como colorar mensajes requieren an que el usuario se autentifique adecuadamente.', null, '1472076022', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2046', 'es', '3', 'configopentogoogle', 'If you enable this setting, then Google will be allowed to enter your site as a Guest.  In addition, people coming in to your site via a Google search will automatically be logged in as a Guest.  Note that this only provides transparent access to courses that already allow guest access.', 'Si activa esta opcin, se permitir a Google entrar al sitio como Invitado. Adems, quien acceda al sitio va bsqueda en Google acceder automticamente como Invitado. Note que esta opcin slo proporciona acceso transparente a los cursos que ya permiten el acceso a invitados.', null, '1472076022', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2047', 'es', '3', 'configoverride', 'Defined in config.php', 'Definido en config.php', null, '1472076022', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2048', 'es', '3', 'configpasswordpolicy', 'Turning this on will make Moodle check user passwords against a valid password policy. Use the settings below to specify your policy (they will be ignored if you set this to \'No\').', 'Si se activa esta opcin, Moodle contrastar las contraseas del usuario con especificaciones de validez de contraseas. Use los ajustes de ms abajo para fijar tales especificaciones (sern pasadas por alto si selecciona \'No\').', null, '1472076022', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2049', 'es', '3', 'configpasswordresettime', 'This specifies the amount of time people have to validate a password reset request before it expires. Usually 30 minutes is a good value.', 'Especifica de cunto tiempo se dispone para validar una solicitud de restablecimiento de contrasea antes de que caduque. En general 30 minutos es un buen valor.', null, '1472076022', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2050', 'es', '3', 'configpathtodu', 'Path to du. Probably something like /usr/bin/du. If you enter this, pages that display directory contents will run much faster for directories with a lot of files.', 'Ruta a du (probablemente algo parecido a /usr/bin/du). Si escribe esto, las pginas que muestran el contenido del directorio se ejecutarn mucho ms rpidamente cuando los directorios contengan muchos archivos.', null, '1472076022', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2051', 'es', '3', 'configperfdebug', 'If you turn this on, performance info will be printed in the footer of the standard theme', 'Si activa esta opcin, aparecer la informacin sobre el rendimiento en el pie de pgina del tema estndar.', null, '1472076022', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2052', 'es', '3', 'configprofileroles', 'List of roles that are visible on user profiles and participation page.', 'Lista de roles que son visibles en los perfiles de usuario y en la pgina de participacin.', null, '1472076023', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2053', 'es', '3', 'configprofilesforenrolledusersonly', 'To prevent misuse by spammers, profile descriptions of users who are not yet enrolled in any course are hidden. New users must enrol in at least one course before they can add a profile description.', 'Para prevenir el abuso de los creadores de spam, se ocultan las descripciones del perfil de los usuarios que an no estn matriculados en ningn curso. Los usuarios nuevos deben matricularse en al menos un curso antes de que puedan agregar la descripcin del perfil.', null, '1472076023', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2054', 'es', '3', 'configprotectusernames', 'By default forget_password.php does not display any hints that would allow guessing of usernames or email addresses.', 'Por defecto, forget_password.php no muestra ninguna indicacin que permita adivinar nombres de usuario o direcciones de email.', null, '1472076023', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2055', 'es', '3', 'configproxybypass', 'Comma separated list of (partial) hostnames or IPs that should bypass proxy (e.g., 192.168., .mydomain.com)', 'Lista separada por comas de los nombres de host (parciales) o direcciones IP que deberan saltar el proxy (por ejemplo, 192.168., .mydomain.com)', null, '1472076023', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2056', 'es', '3', 'configproxyhost', 'If this <b>server</b> needs to use a proxy computer (eg a firewall) to access the Internet, then provide the proxy hostname here.  Otherwise leave it blank.', 'Si este <b>servidor</b> necesita usar un proxy (e.g., un cortafuegos) para acceder a Internet, escriba aqu el nombre del proxy. En caso contrario, djelo en blanco.', null, '1472076023', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2057', 'es', '3', 'configproxypassword', 'Password needed to access internet through proxy if required, empty if none (PHP cURL extension required).', 'Contrasea necesaria para acceder a internet a travs del proxy; dejar vaco en caso contrario (se requiere extensin PHP cURL).', null, '1472076023', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2058', 'es', '3', 'configproxyport', 'If this server needs to use a proxy computer, then provide the proxy port here.', 'Si este servidor necesita usar un ordenador proxy, escriba aqu el puerto del proxy.', null, '1472076023', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2059', 'es', '3', 'configproxytype', 'Type of web proxy (PHP5 and cURL extension required for SOCKS5 support).', 'Tipo de proxy web (se requiere extensin PHP5 y cURL para apoyo SOCKS5).', null, '1472076023', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2060', 'es', '3', 'configproxyuser', 'Username needed to access internet through proxy if required, empty if none (PHP cURL extension required).', 'Nombre de usuario necesario para acceder a internet a travs del proxy; dejar vaco en caso contrario (se requiere extensin PHP cURL).', null, '1472076023', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2061', 'es', '3', 'configrecaptchaprivatekey', 'String of characters (private key) used to communicate between your Moodle server and the recaptcha server. ReCAPTCHA keys can be obtained from <a target=\"_blank\" href=\"https://www.google.com/recaptcha\">Google reCAPTCHA</a>.', 'Cadena de caracteres usada para comunicarse entre su servidor Moodle y el servidor recaptcha.net. Obtenga una para este sitio visitando http://recaptcha.net', null, '1472076023', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2062', 'es', '3', 'configrecaptchapublickey', 'String of characters (public key) used to display the reCAPTCHA element in the signup form. ReCAPTCHA keys can be obtained from <a target=\"_blank\" href=\"https://www.google.com/recaptcha\">Google reCAPTCHA</a>.', 'Cadena de caracteres usados para mostrar el elemento reCAPTCHA en el formulario de acceso. Generada por http://recaptcha.net', null, '1472076023', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2063', 'es', '3', 'configrequestcategoryselection', 'Allow the selection of a category when requesting a course.', 'Permitir la seleccin de una categora cuando se solicita un curso.', null, '1472076023', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2064', 'es', '3', 'configrequestedstudentname', 'Word for student used in requested courses', 'Trmino utilizado para \'estudiante\' en los cursos solicitados', null, '1472076023', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2065', 'es', '3', 'configrequestedstudentsname', 'Word for students used in requested courses', 'Trmino utilizado para \'estudiantes\' en los cursos solicitados', null, '1472076024', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2066', 'es', '3', 'configrequestedteachername', 'Word for teacher used in requested courses', 'Trmino utilizado para \'profesor\' en los cursos solicitados', null, '1472076024', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2067', 'es', '3', 'configrequestedteachersname', 'Word for teachers used in requested courses', 'Trmino utilizado para \'profesores\' en los cursos solicitados', null, '1472076024', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2068', 'es', '3', 'configuserquota', 'The maximum number of bytes that a user can store in their own private file area. {$a->bytes} bytes == {$a->displaysize}', 'El nmero mximo de bytes que un usuario puede almacenar en sus carpetas de archivos privados. {$a->bytes} bytes == {$a->displaysize}', null, '1472076024', null, '0', '0');
