INSERT INTO `mdl_tool_customlang` VALUES ('2079', 'es', '3', 'configsecureforms', 'Moodle can use an additional level of security when accepting data from web forms. If this is enabled, then the browser\'s HTTP_REFERER variable is checked against the current form address.  In a very few cases this can cause problems if the user is using a firewall (eg Zonealarm) configured to strip HTTP_REFERER from their web traffic.  Symptoms are getting \'stuck\' on a form. If your users are having problems with the login page (for example) you might want to disable this setting, although it might leave your site more open to brute-force password attacks.  If in doubt, leave this set to \'Yes\'.', 'Moodle puede usar un nivel adicional de seguridad cuando acepta datos provenientes de formularios web. Si la opcin est activada, se contrastar la variable HTTP_REFERER del navegador con la direccin del formulario actual. En muy pocos casos esto ocasiona problemas si el usuario utiliza un cortafuegos (e.g., ZoneAlarm) configurado para desmontar su HTTP_REFERER del trfico web. El sntoma consiste en quedarse \'atascasdo\' en un formulario. Si, pongamos por caso, los usuarios tuvieran problemas con la pgina de acceso, quizs conviniera desactivar la opcin, aun con el riesgo de dejar el sitio ms vulnerable a ataques de fuerza bruta. En caso de duda, seleccione la opcin \'S\'.', null, '1472076025', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2080', 'es', '3', 'configsessioncookie', 'This setting customises the name of the cookie used for Moodle sessions.  This is optional, and only useful to avoid cookies being confused when there is more than one copy of Moodle running within the same web site.', 'Esta opcin personaliza el nombre de la \'cookie\' usada para las sesiones de Moodle. Es opcional, y resulta til nicamente para evitar que las \'cookies\' se confundan cuando hay ms de una copia de Moodle ejecutndose en el mismo sitio web.', null, '1472076025', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2081', 'es', '3', 'configsessioncookiedomain', 'This allows you to change the domain that the Moodle cookies are available from. This is useful for Moodle customisations (e.g. authentication or enrolment plugins) that need to share Moodle session information with a web application on another subdomain. <strong>WARNING: it is strongly recommended to leave this setting at the default (empty) - an incorrect value will prevent all logins to the site.</strong>', 'Le permite cambiar el dominio donde estn disponibles las cookies de Moodle. Es til para la personalizacin de Moodle (por ejemplo, extensiones de identificacin o de matriculacin) que necesitan compartir informacin de la sesin de Moodle con una aplicacin web en otro subdominio. <strong> ADVERTENCIA: se recomienda dejar este ajuste en el valor por defecto (vaco) - un valor incorrecto impedir todos los accesos al sitio </strong>.', null, '1472076025', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2082', 'es', '3', 'configsessioncookiepath', 'If you need to change where browsers send the Moodle cookies, you can change this setting to specify a subdirectory of your web site.  Otherwise the default \'/\' should be fine.', 'Si necesita cambiar el lugar al que los navegadores envan las \'cookies\' de Moodle, cambie esta opcin para especifirar un subdirectorio de su sitio web. En caso contrario, \'/\' por defecto funcionar correctamente..', null, '1472076025', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2083', 'es', '3', 'configsessiontimeout', 'If people logged in to this site are idle for a long time (without loading pages) then they are automatically logged out (their session is ended).  This variable specifies how long this time should be.', 'Si los usuarios conectados al sitio estn inactivos durante mucho tiempo (i.e., sin cargar pginas), sern desconectados automticamente (i.e., terminar la sesin). Esta variable especifica el tiempo de inactividad antes de la desconexin.', null, '1472076025', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2084', 'es', '3', 'configshowicalsource', 'Show source information for iCal events', 'Mostrar informacin del origen de eventos iCal', null, '1472076025', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2085', 'es', '3', 'configshowcommentscount', 'Show comments count, it will cost one more query when display comments link', 'Mostrar el nmero de comentarios. Supone una consulta ms cuando se muestre el enlace a los comentarios', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2086', 'es', '3', 'configshowsiteparticipantslist', 'All of these site students and site teachers will be listed on the site participants list. Who shall be allowed to see this site participants list?', 'Todos los estudiantes y profesores del sitio aparecern en la lista de participantes. Quin puede ver esa lista?', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2087', 'es', '3', 'configsitedefaultlicense', 'Default site licence', 'Licencia predeterminada del sitio', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2088', 'es', '3', 'configsitedefaultlicensehelp', 'The default licence for publishing content on this site', 'Licencia predeterminada para publicar contenidos en este sitio', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2089', 'es', '3', 'configsitemaxcategorydepth', 'Maximum category depth', 'Profundidad mxima de la categora', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2090', 'es', '3', 'configsitemaxcategorydepthhelp', 'This specifies the maximum depth of child categories expanded when displaying categories or combo list. Deeper level categories will appear as links and user can expand them with AJAX request.', 'Especifica la profundidad mxima de las subcategoras cuando se muestan las categoras o la lista combo. Las categoras de nivel ms bajo aparecern como enlaces y los usuarios pueden desplegarlas con una peticin AJAX.', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2091', 'es', '3', 'configslasharguments', '\'Slash arguments\' (using <em>PATH_INFO</em>) is required for SCORM packages and multiple-file resources to display correctly. If your web server doesn\'t support \'slash arguments\' and you are unable to configure it, this setting can be disabled, though it will result in things not working.<br />Note: The use of \'slash arguments\' will be required in future versions of Moodle.', 'Los archivos (imgenes, subidas, etc.) se proporcionan va un script que usa \'slash arguments\'. Este mtodo permite que los archivos sean includos ms fcilmente en la cach de los navegadores, servidores proxy, etc. Desafortunadamente, algunos servidores PHP no permiten usar este mtodo, de modo que si usted tiene problemas para ver archivos o imgenes subidas al servidor (e.g., fotografas de los usuarios), deshabilite este ajuste.', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2092', 'es', '3', 'configsmartpix', 'With this on, icons are served through a PHP script that searches the current theme, then all parent themes, then the Moodle /pix folder. This reduces the need to duplicate image files within themes, but has a slight performance cost.', 'Cuando se activa, los inconos se sirven a travs de un script PHP que busca el tema actual, luego todos los temas padre, luego la carpeta /pix de Moodle. Esto reduce la necesidad de duplicar archivos de imgenes dentro de los temas, pero tiene un pequeo costo de rendimiento.', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2093', 'es', '3', 'configstartwday', 'Start of week', 'Comienzo de la semana', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2094', 'es', '3', 'configstatsfirstrun', 'This specifies how far back the logs should be processed <b>the first time</b> the cronjob wants to process statistics. If you have a lot of traffic and are on shared hosting, it\'s probably not a good idea to go too far back, as it could take a long time to run and be quite resource intensive. (Note that for this setting, 1 month = 28 days. In the graphs and reports generated, 1 month = 1 calendar month.)', 'Esta opcin especifica el momento a partir del cual deberan procesarse los registros <b>la primera vez</b> que el cronjob procesa las estadsticas. Si el sitio tiene mucho trfico y el servidor es compartido, probablemente no sea una buena idea comenzar demasiado pronto, puesto que se tardar mucho tiempo y se consumirn muchos recursos. (Ntese que en esta opcin 1 mes equivale a 28 das, en tanto que en los grficos e informes generados, 1 mes equivale a 1 mes de calendario).', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2095', 'es', '3', 'configstatsmaxruntime', 'Stats processing can be quite intensive, so use a combination of this field and the next one to specify when it will run and how long for.', 'El procesamiento estadstico puede ser muy intenso, de modo que conviene combinar este campo y el siguiente para especificar cundo y durante cunto tiempo funcionar.', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2096', 'es', '3', 'configstatsmaxruntime2', 'Stats processing can be quite intensive, specify maximum time allowed for gathering of one day of statistics. Maximum number of days processed in one cron execution is 31.', 'El procesamiento de datos estadsticos puede ser muy intenso. Especifique el tiempo mximo permitido para recopilar las estadsticas de un da. El nmero mximo de das procesados en una ejecucin del cron es de 31.', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2097', 'es', '3', 'configstatsmaxruntime3', 'This specifies the maximum time allowed to calculate the statistics for one day, bearing in mind that statistics processing can put a big load on the server. The maximum number of days processed in one cron can be specified below.', 'Especifica el tiempo mximo permitido para calcular las estadsticas de un da, teniendo en cuenta que el proceso de datos estadsticos supone una gran carga para el servidor. El nmero mximo de das procesados en un cron puede especificarse ms abajo.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2098', 'es', '3', 'configstatsruntimedays', 'This specifies the maximum number of days processed in each statistics execution. Once the statistics are up-to-date, only one day will be processed, so adjust this value depending of your server load, reducing it if shorter cron executions are needed.', 'Especifica el nmero mximo de das procesados en cada ejecucin estadstica. Una vez que las estadsticas estn al da, se procesar slo un da, as que ajuste este valor en funcin de la carga del servidor, reducindola si es necesario realizar ejecuciones de cron cortas.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2099', 'es', '3', 'configstatsruntimestart', 'What time should the cronjob that does the statistics processing start? Specifying different times is recommended if there are multiple Moodle sites on one server.', 'En qu momento comenzar a trabajar el cronjob que procesa las estadsticas? Se recomienda indicar distintas horas si existen varios Moodle en el mismo servidor.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2100', 'es', '3', 'configstatsuserthreshold', 'This setting specifies the minimum number of enrolled users for a course to be included in statistics calculations.', 'Este ajuste especifica el nmero mnimo de usuarios matriculados en un curso para que este valor sear incluidos en los clculos de las estadsticas.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2101', 'es', '3', 'configstrictformsrequired', 'If enabled, users are prevented from entering a space or line break only in required fields in forms.', 'Si est activado, se impide a los usuarios introducir un espacio en blanco o un salto de lnea en los campos obligatorios de los formularios.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2102', 'es', '3', 'configstripalltitletags', 'Uncheck this setting to allow HTML tags in activity and resource names.', 'Desactive esta opcin para permitir marcas HTML en los nombres de actividades y recursos.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2103', 'es', '3', 'configsupportemail', 'This email address will be published to users of this site as the one to email when they need general help (for example, when new users create their own accounts).  If this email is left blank then no such helpful email address is supplied.', 'Esta direccin email se publicar a los usuarios del sitio como aquella a la que debern dirigirse cuando necesiten ayuda de tipo general (por ejemplo, cuando un usuario nuevo crea su propia cuenta). Si se deja en blanco, no se dispondr de una direccin de ayuda del tipo mencionado.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2104', 'es', '3', 'configsupportname', 'This is the name of a person or other entity offering general help via the support email or web address.', 'Este es el nombre de una persona u otra entidad  que ofrece ayuda general por medio de una direccin email o una pgina web.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2105', 'es', '3', 'configsupportpage', 'This web address will be published to users of this site as the one to go to when they need general help (for example, when new users create their own accounts).  If this address is left blank then no link will be supplied.', 'Esta direccin email se publicar a los usuarios del sitio como aquella a la que debern dirigirse cuando necesiten ayuda de tipo general (por ejemplo, cuando un usuario nuevo crea su propia cuenta). Si se deja en blanco, no se suministrar el enlace correspondiente.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2106', 'es', '3', 'configtempdatafoldercleanup', 'Remove temporary data files from the data folder that are older than the selected time.', 'Eliminar ficheros de datos temporales de la carpeta de datos que sean ms viejos que la fecha seleccionada.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2107', 'es', '3', 'configthemedesignermode', 'Normally all theme images and style sheets are cached in browsers and on the server for a very long time, for performance. If you are designing themes or developing code then you probably want to turn this mode on so that you are not served cached versions.  Warning: this will make your site slower for all users!  Alternatively, you can also reset the theme caches manually from the Theme selection page.', 'Habitualmente todas las imgenes del tema y hojas de estilo se almacenan en cach en los navegadores y en el servidor durante un tiempo muy largo, para mejorar el rendimiento. Si va a redisear los temas o desarrollar cdigo, es probable que desee activar este modo para que no se guarden versiones en la cach. Advertencia: esto har que su sitio sea ms lento para todos los usuarios mientras est activado. Opcionalmente tambin puede restablecer la cach manualmente desde la pgina del selector de temas.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2108', 'es', '3', 'configthemelist', 'Leave this blank to allow any valid theme to be used.  If you want to shorten the theme menu, you can specify a comma-separated list of names here (Don\'t use spaces!).\nFor example:  standard,orangewhite.', 'Deje esta opcin en blanco para permitir que se utilice cualquier tema vlido. Si quiere acortar el men de temas, puede especificar una lista de nombres separados por comas (No use espacios!). Por ejemplo: standard,orangewhite', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2109', 'es', '3', 'configtimezone', 'This is the default timezone for displaying dates - each user can override this setting in their profile. Cron tasks and other server settings are specified in this timezone. You should change the setting if it shows as \"Invalid timezone\"', 'Aqu puede decidir la zona horaria por defecto. sta es la nica zona horaria POR DEFECTO para mostrar fechas -cada usuario puede cambiar esta opcin en su perfil-. La \"Hora del Servidor\" aqu har que Moodle tome por defecto la del sistema operativo, pero esa opcin en el perfil del usuario lo ajustar a la correspondiente zona horaria.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2110', 'es', '3', 'configuseblogassociations', 'Should users be able to organize their blog by associating entries with courses and course modules?', 'Deberan los usuarios poder organizar su blog asociando entradas con los cursos y con los mdulos de curso?', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2111', 'es', '3', 'configuseexternalyui', 'Instead of using local files, use online files available on Yahoo&#145;s servers. WARNING: This requires an internet connection, or no AJAX will work on your site. This setting is not compatible with sites using https.', 'En lugar de usar archivos locales, usar archivos disponibles en lnea en servidores Yahoo&#145;s. ADVERTENCIA: Esto requiere una conexin de internet; de otro modo, AJAX no funcionar en el sitio.', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2112', 'es', '3', 'configusesitenameforsitepages', 'If enabled the site\'s shortname will be used for the site pages node in the navigation rather than the string \'Site pages\'', 'Si est habilitado se utilizar el nombre corto del sitio en lugar de la cadena de texto \'pginas del sitio\' en la navegacin por las pginas del sitio', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2113', 'es', '3', 'configusetags', 'Should tags functionality across the site be enabled?', 'Habilitar la funcionalidad de marcas a travs del sitio?', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2114', 'es', '3', 'configvariables', 'Variables', 'Variables', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2115', 'es', '3', 'configverifychangedemail', 'Enables verification of changed email addresses using allowed and denied email domains settings. If this setting is disabled the domains are enforced only when creating new users.', 'Habilita la verificacin de direcciones de email cambiadas usando ajustes de dominios de correo electrnico permitidos y denegados. Si esta opcin est deshabilitada, los dominios se fuerzan slo cuando se crean usuarios nuevos.', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2116', 'es', '3', 'configvisiblecourses', 'Display courses in hidden categories normally', 'Mostrar normalmente los cursos de categoras ocultas', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2117', 'es', '3', 'configwarning', 'Be careful modifying these settings - strange values could cause problems.', 'Sea cuidadoso al modificar estos resultados (valores extraos pueden ocasionar problemas).', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2118', 'es', '3', 'configyuicomboloading', 'This options enables combined file loading optimisation for YUI libraries. This setting should be enabled on production sites for performance reasons.', 'Esta opcin permite la optimizacin de carga de archivos de bibliotecas YUI. Esta opcin debe estar habilitada en los centros de produccin por razones de rendimiento.', null, '1472076028', null, '0', '0');
