INSERT INTO `mdl_tool_customlang` VALUES ('2125', 'es', '3', 'coursecontact', 'Course contacts', 'Gestores de curso', null, '1472076029', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2126', 'es', '3', 'coursecontact_desc', 'This setting allows you to control who appears on the course description. Users need to have at least one of these roles in a course to be shown on the course description for that course.', 'Esta opcin le permite controlar quin aparece en la descripcin del curso. Los usuarios deben tener al menos uno de estos roles en un curso a fin de poder mostrarlos en la descripcin de ese curso.', null, '1472076029', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2127', 'es', '3', 'courselistshortnames', 'Display extended course names', 'Mostrar nombres extendidos del curso', null, '1472076029', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2128', 'es', '3', 'courselistshortnames_desc', 'If enabled, course short names will be displayed in addition to full names in course lists. If required, extended course names may be customised by editing the \'courseextendednamedisplay\' language string using the language customisation feature.', 'Si est activado, en las listas de cursos se mostrarn los nombres cortos adems de los nombres largos. Si es necesario, los nombres largos de los cursos pueden personalizarse editando la cadena \"courseextendednamedisplay\" utilizando la funcin de personalizacin de idioma.', null, '1472076029', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2129', 'es', '3', 'coursemgmt', 'Manage courses and categories', 'Administrar cursos y categoras', null, '1472076029', null, '0', '0');
