INSERT INTO `mdl_tool_customlang` VALUES ('2138', 'es', '3', 'creatornewroleid', 'Creators\' role in new courses', 'Rol de los creadores en cursos nuevos', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2139', 'es', '3', 'creatornewroleid_help', 'If the user does not already have the permission to manage the new course, the user is automatically enrolled using this role.', 'Si el usuario no tiene an permiso para administrar el nuevo curso, el usuario es matriculado  automticamente utilizando este rol.', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2140', 'es', '3', 'cron', 'Cron', 'Cron', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2141', 'es', '3', 'cron_help', 'The cron.php maintenance script assists some of Moodle\'s modules to perform tasks on a scheduled basis, such as mailing out copies of new forum posts. A mechanism is required to run the script regularly e.g. every 5 minutes.', 'El script de mantenimiento cron.php es requerido por algunos de los mdulos de Moodle para realizar tareas de forma programada tales como enviar por correo la copia de los nuevos mensajes de los foros. Es necesario ejecutar, mediante algn mecanismo programado, la secuencia de comandos que ejecute la accin de cron.php peridicamente, por ejemplo cada 5 minutos.', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2142', 'es', '3', 'cron_link', 'admin/cron', 'admin/cron', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2143', 'es', '3', 'cronclionly', 'Cron execution via command line only', 'Ejecucin de cron slo mediante comandos', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2144', 'es', '3', 'cronerrorclionly', 'Sorry, internet access to this page has been disabled by the administrator.', 'Lo sentimos, el acceso a esta pgina ha sido desactivado por el administrador.', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2145', 'es', '3', 'cronerrorpassword', 'Sorry, you have not provided a valid password to access this page', 'Lo sentimos, no ha introducido una contrasea vlida para acceder a esta pgina', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2146', 'es', '3', 'cronremotepassword', 'Cron password for remote access', 'Contrasea de cron para acceso remoto', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2147', 'es', '3', 'cronwarning', 'The <a href=\"{$a}\">cron.php maintenance script</a> has not been run for at least 24 hours.', 'El <a href=\"{$a}\">script de mantenimiento del cron.php </a> no ha sido ejecutado durante las ltimas 24 horas.', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2148', 'es', '3', 'cronwarningcli', 'The cli/cron.php maintenance script has not been run for at least 24 hours.', 'El script de mantenimiento cli/cron.php no se ha ejecutado por lo menos en las ltimas 24 horas.', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2149', 'es', '3', 'ctyperequired', 'The ctype PHP extension is now required by Moodle, in order to improve site performance and to offer multilingual compatibility.', 'Con el fin de mejorar el rendimiento del sitio y ofrecer compatibilidad multilinge, Moodle requiere la extensin ctype de PHP.', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2150', 'es', '3', 'curlcache', 'cURL cache TTL', 'cURL cach TTL', null, '1472076031', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2151', 'es', '3', 'curlrequired', 'The cURL PHP extension is now required by Moodle, in order to communicate with Moodle repositories.', 'La extensin cURL PHP ahora es requerida por Moodle con el fin de comunicarse con los repositorios de Moodle.', null, '1472076031', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2152', 'es', '3', 'curltimeoutkbitrate', 'Bitrate to use when calculating cURL timeouts (Kbps)', 'Velocidad de transmisin a utilizar cuando se calculan los tiempos de expiracin de cURL (Kbps)', null, '1472076031', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2153', 'es', '3', 'curltimeoutkbitrate_help', 'This setting is used to calculate an appropriate timeout during large cURL requests. As part of this calculation an HTTP HEAD request is made to determine the size of the content. Setting this to 0 disables this request from being made.', 'Este ajuste se usa para calcular un tiempo de expiracin apropiado para las solicitudes cURL grandes. Como parte del clculo se hace una peticin HTTP HEAD para determinar el tamao del contenido. Ajustar este valor a 0 deshabilita que se haga esta solicitud.', null, '1472076031', null, '0', '0');
