INSERT INTO `mdl_tool_customlang` VALUES ('2159', 'es', '3', 'datarootsecurityerror', '<p><strong>SECURITY WARNING!</strong></p><p>Your dataroot directory is in the wrong location and is exposed to the web. This means that all your private files are available to anyone in the world, and some of them could be used by a cracker to obtain unauthorised administrative access to your site!</p>\n<p>You <em>must</em> move dataroot directory ({$a}) to a new location that is not within your public web directory, and update the <code>$CFG->dataroot</code> setting in your config.php accordingly.</p>', '<p><strong>ADVERTENCIA DE SEGURIDAD!</strong></p><p>Su directorio dataroot est en una ubicacin errnea y est expuesto a la web. Esto significa que cualquiera desde cualquier lugar puede acceder a todos sus archivos privados y que algunos de ellos podran ser usados por un cracker para obtener acceso no autorizado al sitio.</p>\n<p>Usted <em>debe</em> cambiar el directorio dataroot ({$a}) a una nueva ubicacin fuera de su directorio web pblico y actualizar el correspondiente ajuste de <code>$CFG->dataroot</code> en su config.php.</p>', null, '1472076031', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2160', 'es', '3', 'datarootsecuritywarning', 'Your site configuration might not be secure. Please make sure that your dataroot directory ({$a}) is not directly accessible via web.', 'La configuracin de su sitio podra no ser segura. Por favor, asegrese de que su directorio raz ({$a}) no es accesible directamente va web.', null, '1472076031', null, '0', '0');
