INSERT INTO `mdl_tool_customlang` VALUES ('2173', 'es', '3', 'debugstringids_desc', 'This option is designed to help translators. When this option is enabled, if you add the parameter strings=1 to a request URL, it will show the language file and string id beside each string that is output.', 'Esta opcin est diseada para ayudar a los traductores. Cuando esta opcin est activada, si se agrega el parmetro strings = 1 para una peticin de URL, se mostrar el archivo de idioma y el identificador de cadena al lado de cada cadena que se emite.', null, '1472076032', null, '0', '0');
