INSERT INTO `mdl_tool_customlang` VALUES ('2188', 'es', '3', 'devicedetectregex', 'Device detection regular expressions', 'Expresiones regulares para la deteccin de dispositivos', null, '1472076034', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2189', 'es', '3', 'devicedetectregex_desc', '<p>By default, Moodle can detect devices of the type default (desktop PCs, laptops, etc), mobile (phones and small hand held devices), tablet (iPads, Android tablets) and legacy (Internet Explorer 6 users).  The theme selector can be used to apply separate themes to all of these.  This setting allows regular expressions that allow the detection of extra device types (these take precedence over the default types).</p>\n<p>For example, you could enter the regular expression \'/(MIDP-1.0|Maemo|Windows CE)/\' to detect some commonly used feature phones add the return value \'featurephone\'.  This adds \'featurephone\' on the theme selector that would allow you to add a theme that would be used on these devices.  Other phones would still use the theme selected for the mobile device type.</p>', '<p>Por defecto Moodle puede detectar dispositivos del tipo \'por defecto\' (PC de escritorio, PC porttil, etc.) dispositivos mviles (telfonos y pequeos dispositivos como PDAs), tabletas (iPads, tabletas Android) y \'heredados\' (usuarios de Internet Explorer 6). Se puede usar el selector de temas para aplicar temas diferentes a cada uno de ellos. Este ajuste admite expresiones regulares que permiten detectar tipos de dispositivos extra (stos tienen precedencia sobre los tipos por defecto).</p><p>Por ejemplo, podra introducir la expresin regular \'/(MIDP-1.0|Maemo|Windows CE)/\' para detectar algunos telfonos usados habitualmente con determinada caracterstica y aadir el valor \'telefonocaracteristica\'. Esto aade \'telefonocaracteristica\' en el selector de temas, lo que permite aadir un tema para usarse con estos dispositivos. El resto de telfonos seguirn usando el tema seleccionado para los tipos de dispositivos mviles.</p>', null, '1472076034', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2190', 'es', '3', 'devicedetectregexexpression', 'Regular expression', 'Expresin regular', null, '1472076034', null, '0', '0');
