INSERT INTO `mdl_tool_customlang` VALUES ('2220', 'es', '3', 'emoticons_desc', 'This form defines the emoticons (or smileys) used at your site. To remove a row from the table, save the form with an empty value in any of the required fields. To register a new emoticon, fill the fields in the last blank row. To reset all the fields into default values, follow the link above.\n\n* Text (required) - This text will be replaced with the emoticon image. It must be at least two characters long.\n* Image name (required) - The emoticon image file name without the extension, relative to the component pix folder.\n* Image component (required) - The component providing the icon.\n* Alternative text (optional) - String identifier and component of the alternative text of the emoticon.', 'Este formulario define los \'emoticons\' (o iconos gestuales o \'caritas\') usados en su sitio. Para eliminar una fila de la tabla, guarde el formulario con un valor vaco en cualquiera de los campos obligatorios. Para registrar un nuevo \'emoticon\', rellene los campos de la ltima fila en blanco. Para restablecer todos los campos en los valores predeterminados, siga el enlace de arriba.\n* Texto (obligatorio) - Este texto ser reemplazado por la imagen de icono gestual. Debe haber al menos dos caracteres de longitud.\n* Nombre de la imagen (obligatorio) - El nombre del fichero de imagen del  icono gestual sin la extensin, como en la carpeta de componentes pix.\n* Componente de imagen (obligatorio) - El componente que proporciona el icono.\n* Texto alternativo (opcional) - identificador de cadena y los componentes del texto alternativo de los iconos gestuales.', null, '1472076037', null, '0', '0');
