INSERT INTO `mdl_tool_customlang` VALUES ('2315', 'es', '3', 'gravatardefaulturl_help', 'Gravatar needs a default image to display if it is unable to find a picture for a given user. Provide a full URL for an image. If you leave this setting empty, Moodle will attempt to use the most appropriate default image for the page you are viewing. Note also that Gravatar has a number of codes which can be used to <a href=\"https://en.gravatar.com/site/implement/images/#default-image\">generate default images</a>.', 'Gravatar necesita una imagen por defecto para utilizar en caso de que no se pueda localizar la imagen de un determinado usuario. Si dejas esta opcin vaca, Moodle intentar usar la imagen por defecto ms adecuada para la pgina que ests viendo. Ten en cuenta que Gravatar dispone de una serie de parmetros que pueden ser usados para <a href=\"https://es.gravatar.com/site/implement/images/#default-image\">generar imgenes por defecto</a>.', null, '1472076046', null, '0', '0');
