INSERT INTO `mdl_tool_customlang` VALUES ('2356', 'es', '3', 'ipblockersyntax', 'Put every entry on one line. Valid entries are either full IP address (such as <b>192.168.10.1</b>) which matches a single host; or partial address (such as <b>192.168.</b>) which matches any address starting with those numbers; or CIDR notation (such as <b>231.54.211.0/20</b>); or a range of IP addresses (such as <b>231.3.56.10-20</b>) where the range applies to the last part of the address. Text domain names (like \'example.com\') are not supported. Blank lines are ignored.', 'Ponga cada entrada en una sola lnea. Son entradas vlidas cada una de las siguientes:\n<br>*direcciones IP completas (como <B>192.168.10.1</B> ) que coinciden con un solo host\n<br>*las direcciones parciales (como <B>192.168 .</B>), que coinciden con cualquier direccin que 	comienza con estos nmeros\n<br>*las notacin CIDR (por 	ejemplo, <B>231.54.211.0/20</B>)\n<br>*los rangos de direcciones IP (como <B>231.3.56.10-20</B>) donde el rango se aplica a la ltima parte de la direccin\n<br>Los nombres de dominio (como \'example.com\') no son compatibles. Las lneas en blanco se ignoran.', null, '1472076050', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2357', 'es', '3', 'iplookup', 'IP address lookup', 'Bsqueda de direccin IP', null, '1472076050', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2358', 'es', '3', 'iplookupgeoplugin', '<a href=\"http://www.geoplugin.com\">geoPlugin</a> service is currently being used to look up geographical information. For more accurate results we recommend installing a local copy of the MaxMind GeoLite database.', 'El servicio <a href=\"http://www.geoplugin.com\">geoPlugin</a> se emplea actualmente para buscar informacin geogrfica. Para tener resultados ms exactos, le recomendamos instalar una copia local de la base de datos MaxMind GeoLite.', null, '1472076050', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2359', 'es', '3', 'iplookupinfo', 'By default Moodle uses the free online NetGeo (The Internet Geographic Database) server to lookup location of IP addresses, unfortunately this database is not maintained anymore and may return <em>wildly incorrect</em> data.\nIt is recommended to install local copy of free GeoLite City database from MaxMind.<br />\nIP address location is displayed on simple map or using Google Maps. Please note that you need to have a Google account and apply for free Google Maps API key to enable interactive maps.', 'Por defecto Moodle utiliza el servidor gratuito en lnea NetGeo (The Internet Geographic Database) para buscar la ubicacin de las direcciones IP. Desafortunadamente, ha cesado el mantenimiento de esta base de datos, y puede devolver informacin <em>totalmente errnea</em>.\nSe recomienda instalar una copia local de la base de datos GeoLite City, desde MaxMind.<br />\nLa ubicacin de la direccin IP se muestra en un mapa simple, o usando Google Maps. Para activar los mapas interactivos necesita tener una cuenta Google y aplicar la clave API de Google Maps.', null, '1472076050', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2360', 'es', '3', 'iplookupmaxmindnote', 'This product includes GeoLite data created by MaxMind, available from <a href=\"http://www.maxmind.com/\">http://www.maxmind.com/</a>.', 'Este producto incluye los datos GeoLite creados por MaxMind, disponibles en <a href=\"http://www.maxmind.com/\">http://www.maxmind.com/</a>.', null, '1472076050', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2361', 'es', '3', 'keeptagnamecase', 'Keep tag name casing', 'Mantener \'casing\' de nombre de marca', null, '1472076050', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2362', 'es', '3', 'lang', 'Default language', 'Idioma por defecto', null, '1472076050', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2363', 'es', '3', 'langcache', 'Cache language menu', 'Guardar en cach el men de idioma', null, '1472076050', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2364', 'es', '3', 'langcache_desc', 'Cache the language menu. If enabled, the list of available translations is cached. The cache is automatically refreshed when you install or delete a language pack via the in-built language packs management tool. If you install a new language pack manually, you have to use Purge all caches feature to refresh the cached list.', 'Cachear el men de idiomas. Si se habilita, la lista de idiomas disponibles se cachea. La cach se refresca automticamente cuando se instala o elimina un paquete de idioma por medio de la herramienta de gestin de paquetes de idiomas incorporada. Si instala un paquete de idioma manualmente, deber usar la caracterstica \"Purgar todas las cachs\" para refrescar la lista cacheada.', null, '1472076050', null, '0', '0');
