INSERT INTO `mdl_tool_customlang` VALUES ('2367', 'es', '3', 'langpackwillbeupdated', 'NOTE: Moodle will try to download updates for your language packs during the upgrade.', 'Durante la actualizacin, Moodle intentar actualizar el paquete de idioma seleccionado actualmente.', null, '1472076051', null, '0', '0');
