INSERT INTO `mdl_tool_customlang` VALUES ('2372', 'es', '3', 'legacyfilesaddallowed_help', 'If a course has legacy course files, allow new files and folders to be added to it.', 'Si un curso tiene archivos de curso heredados, permitir agregarle nuevos archivos y carpeta', null, '1472076051', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2373', 'es', '3', 'legacyfilesinnewcourses', 'Legacy course files in new courses', 'Archivos heredados en los cursos nuevos', null, '1472076051', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2374', 'es', '3', 'legacyfilesinnewcourses_help', 'By default, legacy course files areas are available in upgraded courses only. Please note that some features such as activity backup and restore are not compatible with this setting.', 'De forma predeterminada los archivos heredados slo estn disponibles en los cursos actualizados desde versiones anteriores de Moodle (1.9.x a 2.0 por ejemplo). Tenga en cuenta que algunas caractersticas como la copia de seguridad y la restauracin no son compatibles con esta configuracin.', null, '1472076051', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2375', 'es', '3', 'licensesettings', 'Licence settings', 'Configuracin de licencias', null, '1472076051', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2376', 'es', '3', 'linkadmincategories', 'Link admin categories', 'Enlace al administrador de categoras', null, '1472076051', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2377', 'es', '3', 'linkadmincategories_help', 'If enabled admin setting categories will be displayed as links in the navigation and will lead to the admin category pages.', 'Si se habilita, los parmetros de configuacin de las categoras se mostrarn como enlaces en la barra de navegacin y cargarn a las pginas de la categora.', null, '1472076051', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2378', 'es', '3', 'linkcoursesections', 'Always link course sections', 'Enlazar siempre las secciones de los cursos', null, '1472076052', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2379', 'es', '3', 'linkcoursesections_help', 'Always try to provide a link for course sections. Course sections are usually only shown as links if the course format displays a single section per page. If this setting is enabled a link will always be provided.', 'Intenta proporcionar siempre un enlace a la secciones de los cursos. Las secciones de los cursos son mostradas normalmente como enlaces si el formato del curso muestra una seccin por pgina. Si este ajuste est habilitado se mostrar siempre un enlace.', null, '1472076052', null, '0', '0');
