INSERT INTO `mdl_tool_customlang` VALUES ('2387', 'es', '3', 'lockoutduration_desc', 'Locked out account is automatically unlocked after this duration.', 'La cuenta bloqueada se desbloquea automticamente despus de esta tiempo.', null, '1472076052', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2388', 'es', '3', 'lockoutemailbody', 'Your account with username {$a->username} on server \'{$a->sitename}\'\nwas locked out after multiple invalid login attempts.\n\nTo unlock the account immediately go to the following address\n\n{$a->link}\n\nIn most mail programs, this should appear as a blue link\nwhich you can just click on.  If that doesn\'t work,\nthen copy and paste the address into the address\nline at the top of your web browser window.\n\nIf you need help, please contact the site administrator,\n{$a->admin}', 'Su cuenta de usuario {$a->username} en el sitio \'{$a->sitename}\' ha sido bloqueada tras mltiples intentos de acceso no vlidos.\n\nPara desbloquear la cuenta de forma inmediata pulse en el siguiente enlace\n\n{$a->link}\n\nEn la mayora de programas de correo aparecer como un enlace en azul sobre el que puede pulsar. Si no funciona, simplemente copie el texto del enlace y pguelo en la barra de direcciones de la parte superior de su navegador web.\n\nSi necesita ayuda, por favor contacte con el administrador del sitio, {$a->admin}', null, '1472076053', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2389', 'es', '3', 'lockoutemailsubject', 'Your account on {$a} was locked out', 'Su cuenta en {$a} fue bloqueada', null, '1472076053', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2390', 'es', '3', 'lockouterrorunlock', 'Invalid account unlock information supplied.', 'Suministrada informacin no vlida de bloqueo de cuenta.', null, '1472076053', null, '0', '0');
