INSERT INTO `mdl_tool_customlang` VALUES ('2392', 'es', '3', 'lockoutthreshold_desc', 'Select number of failed login attempts that result in account lockout. This feature may be abused in denial of service attacks.', 'Seleccione el nmero de intentos de conexin fallidos que dan como resultado el bloqueo de la cuenta. Esta caracterstica puede ser objeto de abuso en ataques de denegacin de servicio.', null, '1472076053', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2393', 'es', '3', 'lockoutwindow', 'Account lockout observation window', 'Ventana de observacin de cuenta bloqueada', null, '1472076053', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2394', 'es', '3', 'lockoutwindow_desc', 'Observation time for lockout threshold, if there are no failed attempts the threshold counter is reset after this time.', 'Tiempo de observacin para el umbral de bloqueo, si no hay intentos fallidos el contador se restablece despus de este tiempo.', null, '1472076053', null, '0', '0');
