INSERT INTO `mdl_tool_customlang` VALUES ('2397', 'es', '3', 'logguests_help', 'This setting enables logging of actions by guest account and not logged in users. High profile sites may want to disable this logging for performance reasons. It is recommended to keep this setting enabled on production sites.', 'Esta configuracin habilita el registro de acciones para cuentas de invitados o usuarios no registrados. En determinados sitios se podra desactivar esta opcin por razones de rendimiento. Se recomienda mantener esta opcin habilitada en los sitios en produccin.', null, '1472076054', null, '0', '0');
