INSERT INTO `mdl_tool_customlang` VALUES ('2399', 'es', '3', 'loginpageautofocus', 'Autofocus login page form', 'Formulario de pgina de enfoque automtico de inicio de sesin', null, '1472076054', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2400', 'es', '3', 'loginpageautofocus_help', 'Enabling this option improves usability of the login page, but automatically focusing fields may be considered an accessibility issue.', 'Al activar esta opcin se mejora la usabilidad de la pgina de identificacin de usuario, pero el enfoque automtico de campos puede ser considerado como un problema de accesibilidad.', null, '1472076054', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2401', 'es', '3', 'loginpasswordautocomplete', 'Prevent password autocompletion on login form', 'Evita que la contrasea se autocomplete en el formulario de acceso', null, '1472076054', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2402', 'es', '3', 'loginpasswordautocomplete_help', 'If enabled, users are not allowed to save their account password in their browser.', 'Si est activa, los usuarios no podrn', null, '1472076054', null, '0', '0');
