INSERT INTO `mdl_tool_customlang` VALUES ('2423', 'es', '3', 'maturitycorewarning', 'The version of Moodle that you are about to install or upgrade to contains\nunstable \"{$a}\" development code that is not suitable for use on most production\nsites. If this is not what you wanted then you should make sure you are updating\nfrom a STABLE branch of the Moodle code. See Moodle Docs for more details.', 'La versin de Moodle que usted va a instalar o actualizar contiene cdigo de desarrollo \"{$a}\" que no es adecuada para usarse en la mayora de los sitios de produccin. Si no es esto lo que desea entonces debera asegurarse de que instala o actualiza una versin de una rama \"STABLE\" del cdigo de Moodle. Vea Moodle Docs para ms detalles.', null, '1472076056', null, '0', '0');
