INSERT INTO `mdl_tool_customlang` VALUES ('2429', 'es', '3', 'mbstringrecommended', 'Installing the optional MBSTRING library is highly recommended in order to improve site performance, particularly if your site is supporting non-Latin languages.', 'La instalacin de la librera opcional MBSTRING es muy recomendable para mejorar el rendimiento del sitio, especialmente si su sitio est soportando idiomas no latinos.', null, '1472076057', null, '0', '0');
