INSERT INTO `mdl_tool_customlang` VALUES ('2479', 'es', '3', 'navadduserpostslinks_help', 'If enabled two links will be added to each user in the navigation to view discussions the user has started and posts the user has made in forums throughout the site or in specific courses.', 'Si est habilitado, dos enlaces se aadirn a la navegacin del usuario  para ver las discusiones que el usuario ha comenzado y los mensajes que el usuario ha hecho en foros en todo el sitio o en cursos especficos.', null, '1472076061', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2480', 'es', '3', 'navigationupgrade', 'This upgrade introduces two new navigation blocks that will replace these blocks: Administration, Courses, Activities and Participants.  If you had set any special permissions on those blocks you should check to make sure everything is behaving as you want it.', 'Esta actualizacin introduce dos nuevos bloques de navegacin que sustituirn a estos bloques: Administracin, Cursos, Actividades y Participantes. Si tiene establecido algn permiso especial en estos  bloques debe asegurarse de que todo se est comportando como usted desea.', null, '1472076061', null, '0', '0');
