INSERT INTO `mdl_tool_customlang` VALUES ('2483', 'es', '3', 'navexpandmycourses_desc', 'If enabled, My courses is initially shown expanded in the navigation block on Dashboard.', 'Si se habilita, Mis cursos se muestran inicialmente expandidos en el bloque de navegacin del rea personal.', null, '1472076061', null, '0', '0');
