INSERT INTO `mdl_tool_customlang` VALUES ('2485', 'es', '3', 'navshowfullcoursenames_help', 'If enabled, course full names will be used in the navigation rather than short names.', 'Si se habilita, el nombre completo de los cursos se mostrarn en los elementos de navegacin en lugar de sus nombres cortos.', null, '1472076062', null, '0', '0');
