INSERT INTO `mdl_tool_customlang` VALUES ('2487', 'es', '3', 'navshowfrontpagemods_help', 'If enabled, front page activities will be shown on the navigation under site pages.', 'Si se activa, las actividades de la pgina de portada se mostrarn en la navegacin debajo de las pginas del sitio.', null, '1472076062', null, '0', '0');
