INSERT INTO `mdl_tool_customlang` VALUES ('2493', 'es', '3', 'navsortmycoursessort_help', 'This determines whether courses are listed under My courses according to the sort order (i.e. the order set in Site administration > Courses > Manage courses and categories) or alphabetically by course setting.', 'Determina cmo se mostrarn los cursos que aparecen dentro de la rama de mis cursos en la navegacin. Por  defecto se utiliza el criterio de ordenacin.', null, '1472076063', null, '0', '0');
