INSERT INTO `mdl_tool_customlang` VALUES ('2497', 'es', '3', 'nohttpsformobilewarning', 'It is recommended to enable HTTPS with a valid certificate. The Moodle app will always try to use a secured connection first.', 'Se recomienda que se habilite HTTPS con un certificado vlido. La aplicacin Moodle siempre intentar usar una conexin segura en primer lugar.', null, '1472076063', null, '0', '0');
