INSERT INTO `mdl_tool_customlang` VALUES ('2503', 'es', '3', 'maxtimelimit_desc', 'To restrict the maximum PHP execution time that Moodle will allow without any output being displayed, enter a value in seconds here. 0 means that Moodle default restrictions are used. If you have a front-end server with its own time limit, set this value lower to receive PHP errors in logs. Does not apply to CLI scripts.', 'Para restringir el tiempo mximo de ejecucin de PHP que Moodle permitir sin que se muestre ninguna salida, introduzca aqu un valor en segundos. 0 significa que se utilizan restricciones predeterminadas de Moodle. Si dispone de un servidor front-end con su propio lmite de tiempo, establezca este valor ms bajo para recibir errores de PHP en los logs. No se aplica a los scripts de CLI.', null, '1472076063', null, '0', '0');
