INSERT INTO `mdl_tool_customlang` VALUES ('2511', 'es', '3', 'numberofstrings', 'Total number of strings: {$a->strings}<br />Missing: {$a->missing} ({$a->missingpercent}&nbsp;%)', 'Nmero total de cadenas: {$a->strings}<br />Ausentes: {$a->missing} ({$a->missingpercent}&nbsp;%)', null, '1472076064', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2512', 'es', '3', 'opcacherecommended', 'PHP opcode caching improves performance and lowers memory requirements, OPcache extension is recommended and fully supported.', 'PHP opcode cach mejora el rendimiento y reduce los requisitos de memoria, se recomienda la extensin OPcache, totalmente compatible.', null, '1472076064', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2513', 'es', '3', 'opensslrecommended', 'Installing the optional OpenSSL library is highly recommended -- it enables Moodle Networking functionality.', 'Instalar la librera opcional OpenSSL es altamente recomendado -- activa la funcionalidad de red de Moodle (\'Moodle Networking\').', null, '1472076064', null, '0', '0');
