INSERT INTO `mdl_tool_customlang` VALUES ('2521', 'es', '3', 'passwordchangelogout_desc', 'If enabled, when a password is changed, all browser sessions are terminated, apart from the one in which the new password is specified. (This setting does not affect password changes via bulk user upload.)', 'Si se activa, cuando la clave sea modificada todas las sesiones del navegador sern terminadas, a excepcin de en la que se ha introducido la nueva contrasea. (Este ajuste no afecta a los cambios realizados va subida masiva de usuarios.)', null, '1472076064', null, '0', '0');
