INSERT INTO `mdl_tool_customlang` VALUES ('2525', 'es', '3', 'passwordreuselimit_desc', 'Number of times a user must change their password before they are allowed to reuse a password. Hashes of previously used passwords are stored in local database table. This feature might not be compatible with some external authentication plugins.', 'Nmero de veces que un usuario puede cambiar su contrasea antes de que se le permita reutilizar una contrasea. Los hashes de las contraseas utilizadas anteriormente son almacenados en una tabla de la base de datos local. Esta opcin puede no ser compatible con algunos plugins de autentificacin externos.', null, '1472076065', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2526', 'es', '3', 'pathtodot', 'Path to dot', 'Ruta a dot', null, '1472076065', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2527', 'es', '3', 'pathtodot_help', 'Path to dot. Probably something like /usr/bin/dot. To be able to generate graphics from DOT files, you must have installed the dot executable and point to it here. Note that, for now, this only used by the profiling features (Development->Profiling) built into Moodle.', 'Ruta hasta el ejecutable de dot. Probablemente algo como /usr/bin/dot. Para ser capaz de generar grficos a partir de ficheros DOT necesita tener instalado el ejecutable de dot (de las utilidades Graphviz) y apuntar al mismo desde aqu. Note que por ahora solo lo usan las caractersticas de perfilado (Desarrollo->Perfilado) incorporadas en Moodle.', null, '1472076065', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2528', 'es', '3', 'pathtodu', 'Path to du', 'Ruta a du', null, '1472076065', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2529', 'es', '3', 'pathtogs', 'Path to ghostscript', 'Ruta del ghostcript', null, '1472076065', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2530', 'es', '3', 'pathtogs_help', 'On most Linux installs, this can be left as \'/usr/bin/gs\'. On Windows it will be something like \'c:\\gs\\bin\\gswin32c.exe\' (make sure there are no spaces in the path - if necessary copy the files \'gswin32c.exe\' and \'gsdll32.dll\' to a new folder without a space in the path)', 'En la mayora de instalaciones de Linux, puede dejarse como \'/usr/bin/gs\'. En Windows sera algo similar a \'c:gsbingswin32c.exe\' (asegrese que no existen espacios en la ruta - si es necesario copie los ficheros \'gswin32c.exe\' y \'gsdll32.dll\' a una nueva carpeta sin espacios en su ruta)', null, '1472076065', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2531', 'es', '3', 'pathtopgdump', 'Path to pg_dump', 'Ruta a pg_dump', null, '1472076066', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2532', 'es', '3', 'pathtopgdumpdesc', 'This is only necessary to enter if you have more than one pg_dump on your system (for example if you have more than one version of postgresql installed)', 'Slo es necesario entrar si usted tiene m de un pg_dump en su sistema (por ejemplo, si tiene instalada ms de una versin de postgresql)', null, '1472076066', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2533', 'es', '3', 'pathtopgdumpinvalid', 'Invalid path to pg_dump - either wrong path or not executable', 'Ruta no vlida a pg_dump: o bien es errnea, o bien no es ejecutable', null, '1472076066', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2534', 'es', '3', 'pathtopsql', 'Path to psql', 'Ruta a psql', null, '1472076066', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2535', 'es', '3', 'pathtopsqldesc', 'This is only necessary to enter if you have more than one psql on your system (for example if you have more than one version of postgresql installed)', 'Esto slo es necesario si tiene ms de un psql en su sistema (por ejemplo, si tiene instalada ms de una versin de postgresql)', null, '1472076066', null, '0', '0');
