INSERT INTO `mdl_tool_customlang` VALUES ('2538', 'es', '3', 'pathtounoconv_help', 'Path to unoconv document converter. This is an executable that is capable of converting between document formats supported by LibreOffice. This is optional, but if specified, Moodle will use it to automatically convert between document formats. This is used to support a wider range of input files for the assignment annotate PDF feature.', 'Ruta del conversor de documentos unoconv. Se trata de un ejecutable que es capaz de convertir formatos de documento soportados por LibreOffice. Es opcional, pero si se especifica, Moodle lo usar para convertir automticamente entre formatos de documentos. Se utiliza para dar soporte a un rango ms amplio de tipos de ficheros que se usan con la herramienta de \"Anotacin PDF\" de las Tareas.', null, '1472076066', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2539', 'es', '3', 'pcreunicodewarning', 'It is strongly recommended to use PCRE PHP extension that is compatible with Unicode characters.', 'Se recomienda encarecidamente usar la extensin PCRE PHP que sea compatible con caracteres Unicode.', null, '1472076066', null, '0', '0');
