INSERT INTO `mdl_tool_customlang` VALUES ('2601', 'es', '3', 'profilevisible_help', '* Not visible - For private data only viewable by administrators\n* Visible to user - For private data only viewable by the user and by administrators\n* Visible to everyone', '<p>Se puede asignar a cada campo personalizado uno de tres ajustes de visibilidad: invisible, a todo el mundo y usuario. El ajuste \'invisible\' normalmente es decidido por un administrador que quiere mantener la privacidad de los datos de los usuarios. El ajuste \'usuario\' es seleccionado normalmente para un campo que contiene informacin delicada, en tanto que la opcin \'todo el mundo\' puede usarse para cualquier tipo de informacin.</p>', null, '1472076072', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2602', 'es', '3', 'profilevisibleall', 'Visible to everyone', 'Todos pueden verlo', null, '1472076072', null, '0', '0');
