INSERT INTO `mdl_tool_customlang` VALUES ('2605', 'es', '3', 'profiling', 'Profiling', 'Perfilado', null, '1472076072', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2606', 'es', '3', 'profilingallowall', 'Continuous profiling', 'Perfilado continuo', null, '1472076072', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2607', 'es', '3', 'profilingallowall_help', 'If you enable this setting, then, at any moment, you can use the PROFILEALL parameter anywhere (PGC) to enable profiling for all the executed scripts along the Moodle session life. Analogously, you can use the PROFILEALLSTOP parameter to stop it.', 'Si habilita este ajuste entonces, en cualquier momento, puede usar el parmetros PROFILEALL en cualquier parte (PGC) para habilitar el perfilado de todos los scripts ejecutados durante la duracin de la sesin Moodle. De igual manera, puede usar el parmetro PROFILEALLSTOP para detenerlo.', null, '1472076072', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2608', 'es', '3', 'profilingallowme', 'Selective profiling', 'Perfilado selectivo', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2609', 'es', '3', 'profilingallowme_help', 'If you enable this setting, then, selectively, you can use the PROFILEME parameter anywhere (PGC) and profiling for that script will happen. Analogously, you can use the DONTPROFILEME parameter to prevent profiling to happen', 'Si habilita este ajuste entonces, de forma selectiva, puede usar el parmetro PROFILEME en cualquier parte (PGC) y se habilitar el perfilado para ese script. De igual manera, puede usar el parmetro DONTPROFILEME para evitar que tenga lugar el perfilado.', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2610', 'es', '3', 'profilingautofrec', 'Automatic profiling', 'Perfilado automtico', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2611', 'es', '3', 'profilingautofrec_help', 'By configuring this setting, some request (randomly, based on the frequency specified - 1 of N) will be picked and automatically profiled, storing results for further analysis. Note that this way of profiling observes the include/exclude settings. Set it to 0 to disable automatic profiling.', 'Al configurar este ajuste, algunas peticiones (de forma aleatoria, basada en la frecuencia especificada - 1 de cada N) ser escogida y perfilada automticamente, almacenando los resultados para un anlisis posterior. Note que esta forma de perfilado respeta los ajustes de inclusion/exclusin. Ponga el valor a 0 para deshabilitar el perfilado automtico.', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2612', 'es', '3', 'profilingenabled', 'Enable profiling', 'Habilitar perfiles', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2613', 'es', '3', 'profilingenabled_help', 'If you enable this setting, then profiling will be available in this site and you will be able to define its behavior by configuring the next options.', 'Si habilita este ajuste el perfilado estar disponible en este sitio y podr definir su comportamiento configurando las siguientes opciones.', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2614', 'es', '3', 'profilingexcluded', 'Exclude profiling', 'Excluir perfiles', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2615', 'es', '3', 'profilingexcluded_help', 'List of (comma separated, absolute skipping wwwroot, callable) URLs that will be excluded from being profiled from the ones defined by \'Profile these\' setting.', 'Lista de URLs (absolutas quitando la parte de wwwroot, llamables, separadas por comas) que se excluirn del perfilado, de entre las definidas en el ajuste \'Perfilar estas\'.', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2616', 'es', '3', 'profilingimportprefix', 'Profiling import prefix', 'Prefijo de la importacin de perfiles', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2617', 'es', '3', 'profilingimportprefix_desc', 'For easier detection, all the imported profiling runs will be prefixed with the value specified here.', 'Para una deteccin ms fcil, todas las importaciones de perfiles se prefijan con el valor que aqu se especifica,', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2618', 'es', '3', 'profilingincluded', 'Profile these', 'Perfilar estos', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2619', 'es', '3', 'profilingincluded_help', 'List of (comma separated, absolute skipping wwwroot, callable) URLs that will be automatically profiled. Examples: /index.php, /course/view.php. Also accepts the * wildchar at any position. Examples: /mod/forum/*, /mod/*/view.php.', 'Lista de URLs (absolutas quitando la parte de wwwroot, llamables, separadas por comas) que sern perfiladas automticametne. Ejemplos: /index.php,/course/view.php. Tambin acepta el comodn * en cualquier posicin. Ejemplos: /mod/forum/*, /mod/*/view.php.', null, '1472076074', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2620', 'es', '3', 'profilinglifetime', 'Keep profiling runs', 'Mantener perfilado de ejecuciones', null, '1472076074', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2621', 'es', '3', 'profilinglifetime_help', 'Specify the time you want to keep information about old profiling runs. Older ones will be pruned periodically. Note that this excludes any profiling run marked as \'reference run\'.', 'Especifique cuanto tiempo desea mantener la informacin de anteriores ejecuciones de perfilado. Las ms antiguas se eliminarn automticamente. Note que esto excluye cualquier ejecucin de perfilado marcada como \'ejecucin de referencia\'.', null, '1472076074', null, '0', '0');
