INSERT INTO `mdl_tool_customlang` VALUES ('2631', 'es', '3', 'questioncwqpfscheck', 'One or more \'random\' questions in a quiz are set up to select questions from a mixture of shared and unshared question categories. There is a more detailed report <a href=\"{$a->reporturl}\">here</a> and see Moodle Docs page <a href=\"{$a->docsurl}\">here</a>.', 'Una o ms preguntas \'aleatorias\' de un cuestionario se disponen para seleccionar preguntas de una mezcla de categoras de pregunta compartidas y no compartidas. Puede ver un informe ms detallado <a href=\"{$a->reporturl}\">aqu</a> o consultar la pgina de Moodle Docs <a href=\"{$a->docsurl}\">here</a>.', null, '1472076075', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2632', 'es', '3', 'questioncwqpfsok', 'Good. There are no \'random\' questions in your quizzes that are set up to select questions from a mixture of shared and unshared question categories.', 'Bueno. No existen preguntas \'aleatorias\' en sus cuestionarios que estn ajustadas para seleccionar preguntas a partir de una mezcla de categoras de pregunta compartidas y no compartidas.', null, '1472076075', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2633', 'es', '3', 'questiontype', 'Question type', 'Tipo de pregunta', null, '1472076075', null, '0', '0');
