INSERT INTO `mdl_tool_customlang` VALUES ('2635', 'es', '3', 'quizattemptsupgradedmessage', 'In Moodle 2.1 there was a major upgrade to questions. It was possible to delay parts of the database upgrade to be run later. Before upgrading to Moodle 2.7, this upgrade must be completed.', 'En Moodle 2.1 se produjo una importante actualizacin de preguntas. Fue posible retrasar partes de la actualizacin de base de datos que se ejecute ms tarde. Antes de actualizar a Moodle 2.7, se debe completar la actualizacin.', null, '1472076075', null, '0', '0');
