INSERT INTO `mdl_tool_customlang` VALUES ('2640', 'es', '3', 'registermoodleorgli1', 'You are added to a low-volume mailing list for important notifications such as security alerts and new releases of Moodle.', 'Su nombre se ha aadido a una lista de correo de bajo volumen para recibir las notificaciones importantes, como alertas de seguridad  o nuevas versiones de Moodle.', null, '1472076075', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2641', 'es', '3', 'registermoodleorgli2', 'Statistics about your site will be added to the {$a} of the worldwide Moodle community.', 'Las estadsticas sobre su sitio se incorporarn a la {$a} de la comunidad de Moodle en todo el mundo.', null, '1472076075', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2642', 'es', '3', 'registerwithmoodleorg', 'Register your site', 'Registre su sitio', null, '1472076075', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2643', 'es', '3', 'registration', 'Registration', 'Registro', null, '1472076076', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2644', 'es', '3', 'registration_help', 'It is recommended that you register your site in order to receive security alerts and access to Moodle.net, our course sharing platform.', 'Registrar su sitio en Moodle.org se recomienda para recibir alertas de seguridad, para contribuir a las <a href=\"http://moodle.org/stats\">estadsticas de uso de Moodle</a> y para poder compartir cursos en <a href=\"http://moodle.org/\">Moodle.net</a>.', null, '1472076077', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2645', 'es', '3', 'registrationwarning', 'Your site is not yet registered.', 'Su sitio an no est registrado.', null, '1472076077', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2646', 'es', '3', 'releasenoteslink', 'For information about this version of Moodle, please see the online <a target=\"_blank\" href=\"{$a}\">Release Notes</a>', 'Si desea informacin sobre esta versin de Moodle, por favor vea <a target=\"_blank\" href=\"{$a}\">Release Notes</a>', null, '1472076077', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2647', 'es', '3', 'rememberusername', 'Remember username', 'Recordar nombre de usuario', null, '1472076077', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2648', 'es', '3', 'rememberusername_desc', 'Enable if you want to store permanent cookies with usernames during user login. Permanent cookies may be considered a privacy issue if used without consent.', 'Activar si desea almacenar las cookies permanentes con nombres de usuario durante el inicio de sesin. Las cookies permanentes se deben tratar como un asunto de privacidad si se utilizan sin consentimiento.', null, '1472076077', null, '0', '0');
