INSERT INTO `mdl_tool_customlang` VALUES ('2650', 'es', '3', 'requiredentrieschanged', '<strong>IMPORTANT - PLEASE READ<br/>(This warning message will only be displayed during this upgrade)</strong><br/>Due to a bug fix, the behaviour of database activities using the \'Required entries\' and \'Required entries before viewing settings\' settings will change. A more detailed explanation of the changes can be read on <a href=\"http://moodle.org/mod/forum/discuss.php?d=110928\" target=\"_blank\">the database module forum</a>. The expected behavior of these settings can also be read on <a href=\"http://docs.moodle.org/en/Adding/editing_a_database#Required_entries\" target=\"_blank\">Moodle Docs</a>.\n<br/><br/>This change affects the following databases in your system: (Please save this list now, and after the upgrade, check that these activities still work the way that the teacher intends.)<br/><strong>{$a->text}</strong><br/>', '<strong>IMPORTANTE - LALO, POR FAVOR<br/>(Este mensaje de advertencia slo aparecer durante esta actualizacin)</strong><br/>Debido a la solucin de un \'bug\', cambiar el comportamiento de las actividades base de datos que utilizan los ajustes \'Entradas requeridas\' y \'Entradas requeridas antes de ver los ajustes\'. Puede ver una explicacin ms detallada de estos cambios en <a href=\"http://moodle.org/mod/forum/discuss.php?d=110928\" target=\"_blank\">el foro del mdulo base de datos</a>. El funcionamiento esperado de estos ajustes puede consultarse asimismo en <a href=\"http://docs.moodle.org/en/Adding/editing_a_database#Required_entries\" target=\"_blank\">Moodle Docs</a>.\n<br/><br/>Este cambio afecta a las siguientes bases de datos de su sistema: (Por favor, guarde ahora esta lista y, despus de la actualizacin, compruebe que estas actividades siguen funcionando del modo que desea el profesor.)<br/><strong>{$a->text}</strong><br/>', null, '1472076077', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2651', 'es', '3', 'requiremodintro', 'Require activity description', 'Requerir descripcin de la actividad', null, '1472076077', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2652', 'es', '3', 'requiremodintro_desc', 'If enabled, users will be forced to enter a description for each activity.', 'Si se activa, los usuarios sern forzados a ingresar una descripcin para cada actividad.', null, '1472076077', null, '0', '0');
