INSERT INTO `mdl_tool_customlang` VALUES ('2654', 'es', '3', 'purgecaches', 'Purge all caches', 'Purgar todas las cachs', null, '1472076077', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2655', 'es', '3', 'purgecachesconfirm', 'Moodle can cache themes, javascript, language strings, filtered text, rss feeds and many other pieces of calculated data.  Purging these caches will delete that data from the server and force browsers to refetch data, so that you can be sure you are seeing the most up-to-date values produced by the current code.  There is no danger in purging caches, but your site may appear slower for a while until the server and clients calculate new information and cache it.', 'Moodle puede guardar en cach los temas, javascript, cadenas de idioma, texto filtrado, RSS feeds y muchos otros datos. La depuracin de estos datos en el servidor forzar a los navegadores de los clientes a actualizar la informacin y usted se asegurar de que los usuarios estn viendo la informacin con los cambios ms recientes. No se corre ningn riesgo por hacerlo, aunque su sitio podra parecer algo ms lento en un principio hasta que el servidor y los clientes vuelven a actualizar la informacin guardndose nuevamente los datos en la cach.', null, '1472076078', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2656', 'es', '3', 'purgecachesfinished', 'All caches were purged.', 'Todas las cachs han sido purgadas', null, '1472076078', null, '0', '0');
