INSERT INTO `mdl_tool_customlang` VALUES ('2692', 'es', '3', 'sessionautostartwarning', '<p>Serious configuration error detected, please notify server administrator.</p><p> To operate properly, Moodle requires that administrator changes PHP settings.</p><p><code>session.auto_start</code> must be set to <code>off</code>.</p><p>This setting is controlled by editing <code>php.ini</code>, Apache/IIS <br />configuration or <code>.htaccess</code> file on the server.</p>', '<p>Se ha detectado un error de configuracin grave; por favor notifique al administrador del servidor. </p><p>Para que funcione correctamente, Moodle requiere que el administrador cambie la configuracin de PHP. </ p><p> <code> session.auto_start </ code> debe establecerse en <code>off </ code>. </ p> <p>Esta configuracin se controla editando <code> php.ini </ code>, la configuracin de  Apache/IIS <br /> o el fichero <code>. htaccess </ code> en el servidor. </ p>', null, '1472076080', null, '0', '0');
