INSERT INTO `mdl_tool_customlang` VALUES ('2700', 'es', '3', 'settingsafemode', 'Moodle is not fully compatible with safe mode, please ask server administrator to turn it off. Running Moodle under safe mode is not supported, please expect various problems if you do so.', 'Moodle no es totalmente compatible con el modo seguro, por favor, pida al administrador del servidor que lo desactive. La ejecucin de Moodle en modo seguro no es compatible, se producirn diversos problemas si lo hace.', null, '1472076081', null, '0', '0');
