INSERT INTO `mdl_tool_customlang` VALUES ('2710', 'es', '3', 'sitemaintenanceon', 'Your site is currently in maintenance mode (only admins can log in or use the site).', 'El sitio est en modo mantenimiento (slo los administradores tienen acceso).', null, '1472076081', null, '0', '0');
