INSERT INTO `mdl_tool_customlang` VALUES ('2712', 'es', '3', 'sitemaintenancewarning', 'Your site is currently in maintenance mode (only admins can log in).  To return this site to normal operation, <a href=\"maintenance.php\">disable maintenance mode</a>.', 'El sitio est en modo mantenimiento (slo los administradores tienen acceso). Para ponerlo en funcionamiento de nuevo, <a href=\"maintenance.php\">desactive el modo de mantenimiento</a>.', null, '1472076082', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2713', 'es', '3', 'sitemaintenancewarning2', 'Your site is currently in maintenance mode (only admins can log in).  To return this site to normal operation, <a href=\"{$a}\">disable maintenance mode</a>.', 'Su sitio se encuentra actualmente en modo de mantenimiento (solo los administradores pueden iniciar sesin). Para devolver este sitio a la operacin normal, <a href=\"{$a}\">desactive el modo de mantenimiento</a>.', null, '1472076082', null, '0', '0');
