INSERT INTO `mdl_tool_customlang` VALUES ('2718', 'es', '3', 'sitepolicyguest_help', 'If you have a site policy that all guests must see and agree to before using this site, then specify the URL to it here, otherwise leave this field blank. This setting can contain any public URL. Note: access of not-logged-in users may be prevented with forcelogin setting.', 'Si su poltica exige que todos los invitados lean y acepten sus condiciones antes de usar el sitio, especifique aqu la URL que muestra esta informacin; en caso contrario, dje el campo en blanco. Este campo de configuracin puede contener  cualquier direccin URL pblica.\n<p>Nota: El acceso de usuarios no registrados pueden evitarse \'forzando a los usuarios a identificarse\'. </p>', null, '1472076082', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2719', 'es', '3', 'sitesectionhelp', 'If selected, a topic section will be displayed on the site\'s front page.', 'Si se selecciona, se mostrar una seccin en la pgina principal del sitio.', null, '1472076082', null, '0', '0');
