INSERT INTO `mdl_tool_customlang` VALUES ('2838', 'es', '3', 'updatenotificationfooter', 'Your Moodle site {$a->siteurl} is configured to automatically check for available updates. You are receiving this message as the administrator of the site. You can disable automatic checks for available updates in the Site administration section of the Administration block. You can customise the delivery of this message via your preferences page.', 'Su sitio Moodle {$a->siteurl} est configurado para que compruebe automticamente si existen actualizaciones disponibles. Usted est recibiendo este mensaje como administrador del sitio. Puede deshabilitar las comprobaciones automticas de actualizaciones disponibles en la seccin del men Ajustes, Administracin del Sitio. Puede configurar el envo de este mensaje desde su configuracin personal de Mensajes, en la opcin Mi Perfil.', null, '1472076092', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2839', 'es', '3', 'updatenotificationsubject', 'Moodle updates are available ({$a->siteurl})', 'Actualizaciones de Moodle disponibles ({$a->siteurl})', null, '1472076092', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2840', 'es', '3', 'updateautocheck', 'Automatically check for available updates', 'Compruebe automticamente las actualizaciones disponibles', null, '1472076092', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2841', 'es', '3', 'updateautocheck_desc', 'If enabled, your site will automatically check for available updates for both Moodle code and all additional plugins. If there is a new update available, a notification will be sent to site admins.', 'Si est habilitado, su sitio comprobar automticamente actualizaciones disponibles, tanto para Moodle como para las extensiones adicionales. Si hay una nueva actualizacin disponible, se enviar una notificacin a los administradores.', null, '1472076092', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2842', 'es', '3', 'updateminmaturity', 'Required code maturity', 'Madurez requerida del cdigo', null, '1472076092', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2843', 'es', '3', 'updateminmaturity_desc', 'Notify about available updates only if the available code has the selected maturity level at least. Updates for plugins that do not declare their code maturity level are always reported regardless this setting.', 'Notificarme las actualizaciones disponibles slo si el cdigo tiene al menos el nivel de madurez del cdigo seleccionado. Las actualizaciones para las extensiones que no declaran su nivel de madurez de cdigo se reportan siempre sin tener en cuenta este ajuste.', null, '1472076092', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2844', 'es', '3', 'updatenotifybuilds', 'Notify about new builds', 'Notificacin de nuevas compilaciones', null, '1472076092', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2845', 'es', '3', 'updatenotifybuilds_desc', 'If enabled, the available update for Moodle code is also reported when a new build for the current version is available. Builds are continuous improvements of a given Moodle version. They are generally released every week. If disabled, the available update will be reported only when there is a higher version of Moodle released. Checks for plugins are not affected by this setting.', 'Si est activado, la comprobacin de actualizaciones del cdigo de Moodle tambin informa cuando hay una disponible una nueva compilacin de la versn actual. Normalmente hay nuevas compilaciones cada semana. Si est desactivado, se informar solamente cuando se libere una versin superior de Moodle.Compruebe que las extensiones  no se vean afectadas por este ajuste.', null, '1472076092', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2846', 'es', '3', 'upgradestart', 'Upgrade Moodle database now', 'Actualizar base de datos Moodle ahora', null, '1472076092', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2847', 'es', '3', 'upgradepluginsfirst', 'It is recommended to install all available updates first', 'Se recomienda instalar primero todas las actualizaciones disponibles', null, '1472076092', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2848', 'es', '3', 'upgradepluginsinfo', 'Updating plugins', 'Actualizando extensiones', null, '1472076092', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2849', 'es', '3', 'upgradepluginsinfo_help', 'There are available updates for some of your plugins. You should install them all prior to upgrading Moodle database. If your site does not support automatic updates deployment, you have to download and install new plugin versions at your server manually.', 'Hay actualizaciones disponibles para algunas de sus extensiones. Debera instalar todas ellas antes de actualizar la base de datos de Moodle. Si su sitio no admite la distribucin de actualizaciones automtica, tendr que descargar e instalar en el servidor las nuevas versiones de la extensin de forma manual.', null, '1472076093', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2850', 'es', '3', 'upgradepluginsinfo_link', 'admin/upgradepluginsinfo', 'admin/upgradepluginsinfo', null, '1472076093', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2851', 'es', '3', 'upgradeerror', 'Unknown error upgrading {$a->plugin} to version {$a->version}, can not continue.', 'Error desconocido de actualizacin {$a->plugin} a la versin {$a->version}, no se puede continuar.\n', null, '1472076093', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2852', 'es', '3', 'upgradeforumread', 'A new feature has been added in Moodle 1.5 to track read/unread forum posts.<br />To use this functionality you need to <a href=\"{$a}\">update your tables</a>.', 'Se ha incorporado a Moodle 1.5 una nueva caracterstica para rastrear mensajes enviados al foro ledos y no ledos.<br />Para hacer uso de esta funcionalidad, necesita <a href=\"{$a}\">actualizar sus tablas</a>.', null, '1472076093', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2853', 'es', '3', 'upgradeforumreadinfo', 'A new feature has been added in Moodle 1.5 to track read/unread forum posts.  To use this functionality you need to update your tables with all the tracking information for existing posts.  Depending on the size of your site this can take a long time (hours) and can be quite taxing on the database, so it\'s best to do it during a quiet period.  However, your site will continue functioning during this upgrade and users won\'t be affected.  Once you start this process you should let it finish (keep your browser window open).  However, if you stop the process by closing the window: don\'t worry, you can start over.<br /><br />Do you want to start the upgrading process now?', 'Se ha incorporado a Moodle 1.5 una nueva funcionalidad para rastrear mensajes enviados al foro ledos y no ledos. Para hacer uso de ella, necesita actualizar sus tablas con toda la informacin concerniente a los mensajes existentes. Dependiendo del tamao del sitio, esto puede llevar mucho tiempo (horas) y hacer un uso intensivo de la base de datos, de modo que es mejor llevar a cabo esta operacin durante un perodo de tranquilidad. Sin embargo, el sitio continuar funcionando durante la actualizacin y los usuarios no se vern afectados. Una vez que comience este proceso, debera dejarlo terminar (i.e., mantenga abierta la ventana del navegador). En todo caso, si detiene el proceso cerrando la ventana, no se preocupe, siempre podr recomenzar.<br /><br />Desea comenzar el proceso de actualizacin ahora?', null, '1472076093', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2854', 'es', '3', 'upgradekeyreq', 'Upgrade key required', 'Clave de actualizacin requerida', null, '1472076093', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2855', 'es', '3', 'upgradekeyset', 'Upgrade key (leave empty to not set it)', 'Clave de actualizacin (dejar en blanco para no establecerla)', null, '1472076093', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2856', 'es', '3', 'upgradelogs', 'For full functionality, your old logs need to be upgraded.  <a href=\"{$a}\">More information</a>', 'Para conseguir una funcionalidad total, sus registros antiguos deben ser actualizados. <a href=\"{$a}\">Ms informacin</a>', null, '1472076093', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2857', 'es', '3', 'upgradelogsinfo', 'Some changes have recently been made in the way logs are stored.  To be able to view all of your old logs on a per-activity basis, your old logs need to be upgraded.  Depending on your site this can take a long time (eg several hours) and can be quite taxing on the database for large sites.  Once you start this process you should let it finish (by keeping the browser window open).  Don\'t worry - your site will work fine for other people while the logs are being upgraded.<br /><br />Do you want to upgrade your logs now?', 'Recientemente se han llevado a cabo algunos cambios en la forma en que se almacenan los registros. Para poder ver sus registros antiguos clasificados por actividad, esos registros se deben actualizar. Dependiendo del tamao de su sitio este proceso puede tardar bastante tiempo (e.g., varias horas) puesto que habr de consultar continuamente la base de datos. Una vez iniciado el proceso debe permitir que llegue a su fin (manteniendo la ventana de su navegador abierta). No se preocupe: durante este proceso su sitio funcionar correctamente para los otros usuarios.<br /><br /> Desea actualizar sus registros ahora?', null, '1472076093', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2858', 'es', '3', 'upgradesettings', 'New settings', 'Nuevos ajustes', null, '1472076093', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2859', 'es', '3', 'upgradesettingsintro', 'The settings shown below were added during your last Moodle upgrade. Make any changes necessary to the defaults and then click the &quot;Save changes&quot; button at the bottom of this page.', 'Los ajustes que se muestran ms abajo se agregaron durante la ltima actualizacin de Moodle. Realice los cambios necesarios a los valores por defecto y luego haga clic en el botn \"Guardar cambios\" al final de esta pgina.', null, '1472076093', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2860', 'es', '3', 'upgradestalefiles', 'Mixed Moodle versions detected, upgrade cannot continue', 'Se ha detectado una mezcla de versiones de Moodle . La actualizacin no puede continuar.', null, '1472076093', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2861', 'es', '3', 'upgradestalefilesinfo', 'The Moodle update process has been paused because PHP scripts from at least two major versions of Moodle have been detected in the Moodle directory.\n\nThis can cause significant problems later, so in order to continue you must ensure that the Moodle directory contains only files for a single version of Moodle.\n\nThe recommended way to clean your Moodle directory is as follows:\n\n* rename the current Moodle directory to \"moodle_old\"\n* create a new Moodle directory containing only files from either a standard Moodle package download, or from the Moodle Git repository\n* move the original config.php file and any non-standard plugins from the \"moodle_old\" directory to the new Moodle directory\n\nWhen you have a clean Moodle directory, refresh this page to resume the Moodle update process.\n\nThis warning is often caused by unzipping a standard Moodle package over a previous version of Moodle. While this is OK for minor upgrades, it is strongly discouraged for major Moodle upgrades.\n\nThis warning can also be caused by an incomplete checkout or update operation from the Git repository, in which case you may just have to wait for the operation to complete, or perhaps run the appropriate clean-up command and retry the operation.\n\nYou can find more information in upgrade documentation at <a href=\"{$a}\">{$a}</a>.', 'El proceso de actualizacin de Moodle se ha detenido porque los scripts PHP que se han detectado en el directorio de Moodle corresponden, por lo menos, a dos versiones principales de Moodle anteriores.\n\nEsto puede causar problemas significativos ms adelante, por lo que a fin de continuar, debe asegurarse de que el directorio contiene solo archivos de una nica versin de Moodle.\n\nEl mtodo recomendado para limpiar el directorio Moodle es el siguiente:\n\n* cambie el nombre del directorio actual de Moodle a \"moodlle_od\"\n\n* creer un nuevo directorio Moodle que contenga slo archivos nuevos de un paquete estndar descargado de Moodle o de los repositorios Moodle CVS o GIT\n\n* mueva el archivo config.php original y los plugins no estndar de \"moodle_old\" al nuevo directorio Moodle.\n\nCuando tenga el directorio Moodle limpio, vuelva a cargar esta pgina para reanudar el proceso de actualizacin de Moodle.\n\nEste aviso tambin puede producirse al descomprimir un paquete estndar de Moodle sobre una versin anterior de Moodle. Si bien esto es correcto para actualizaciones menores, se desaconseja para las actualizaciones importantes de Moodle.\n\nEste aviso tambin puede producirse por una operacin de verificacin de actualizacin incompleta realizada desde los repositorios CVS, SVN o GIT, en cuyo caso es posible que slo tenga que esperar a que la operacin se complete, o tal vez deba ejecutar el comando apropiado de limpieza y volver a intentar la operacin.\n\nPuede encontrar ms informacin en la documentacin de actualizacin en <a href=\"{$a}\">{$a}</a>', null, '1472076093', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2862', 'es', '3', 'upgradesure', '<p>Your Moodle files have been changed, and you are about to automatically upgrade your server to this version:</p>\n<p><strong>{$a}</strong></p>\n<p>Once you do this you can not go back again. Please note that this process can take a long time.</p>\n<p>Are you sure you want to upgrade this server to this version?</p>', 'Sus archivos Moodle han sido modificados, y usted est a punto de actualizar automticamente su servidor a esta versin:<br /><br /><strong>\n{$a}</strong><br /><br />\nUna vez que haga esto, no podr volver atrs.<br /><br />Por favor, tenga en cuenta que este proceso puede tardar bastante tiempo.<br /><br />\nEst seguro de que quiere actualizar este servidor a esta versin?', null, '1472076093', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2863', 'es', '3', 'upgradetimedout', 'Upgrade timed out, please restart the upgrade.', 'Se acab el tiempo de actualizacin; por favor, reinicie la actualizacin.', null, '1472076094', null, '0', '0');
