INSERT INTO `mdl_tool_customlang` VALUES ('2886', 'es', '3', 'webproxyinfo', 'Fill in following options if your Moodle server can not access internet directly. Internet access is required for download of environment data, language packs, RSS feeds, timezones, etc.<br /><em>PHP cURL extension is highly recommended.</em>', 'Rellene las siguientes opciones si su servidor Moodle no puede acceder directamente a internet. Es necesario para descargar datos de contexto, paquetes de idioma, canales RSS, zonas horarias, etc.<br /><em>Es muy recomendable la extensin PHP cURL.</em>', null, '1472076096', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2887', 'es', '3', 'xmlrpcrecommended', 'The xmlrpc extension is needed for hub communication, and useful for web services and Moodle networking', 'La extensin opcional xmlrpc ser necesaria para la funcionalidad de la Red Moodle, la conexin a un hub o a los Servicios Web (Web Services)', null, '1472076096', null, '0', '0');
