INSERT INTO `mdl_tool_customlang` VALUES ('2889', 'es', '3', 'ziprequired', 'The Zip PHP extension is now required by Moodle, info-ZIP binaries or PclZip library are not used anymore.', 'Moodle requiere ahora la extensin Zip PHP. Ya no se usan ni las binarias info-ZIP ni la librera PclZip.', null, '1472076096', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2890', 'es', '3', 'caching', 'Caching', 'Almacenamiento en cach', null, '1472076096', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2891', 'es', '3', 'cachesettings', 'Cache settings', 'Configuracin de cach', null, '1472076096', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2892', 'es', '3', 'cacherequest', 'Request cache', 'Solicitar cach', null, '1472076096', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2893', 'es', '3', 'cacherequesthelp', 'User specific cache that expires when the request is complete. Designed to replace areas where we are using the static stores.', 'Cach especfica de usuario que caduca cuando se completa la solicitud. Diseada para remplazar reas en donde estamos usando los almacenamientos estticos.', null, '1472076096', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2894', 'es', '3', 'cachesession', 'Session cache', 'Cach de la sesin', null, '1472076096', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2895', 'es', '3', 'cachesessionhelp', 'User specific cache that expires when the user\'s session ends. Designed to alleviate session bloat/strain.', 'Cach especfica del usuario que caduca cuando termina la sesin del usuario. Diseada para aliviar la sobrecarga de la sesin.', null, '1472076096', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2896', 'es', '3', 'cacheapplication', 'Application cache', 'Cach de aplicacin', null, '1472076097', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2897', 'es', '3', 'cacheapplicationhelp', 'Cached items are shared among all users and expire by a determined time to live (ttl).', 'Los items en cach se comparten entre los usuarios y caducan en un tiempo determinado.', null, '1472076097', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2898', 'es', '4', 'actantivirushdr', 'Available antivirus plugins', 'Plugins de antivirus disponibles', null, '1472076097', null, '0', '0');
