INSERT INTO `mdl_tool_customlang` VALUES ('2901', 'es', '4', 'configantivirusplugins', 'Please choose the antivirus plugins you wish to use and arrange them in order of being applied.', 'Por favor, elige los plugins de antivirus que deseas utilizar y organzalos en el orden en que sern aplicados.', null, '1472076097', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2902', 'es', '4', 'emailsubject', '{$a} :: Antivirus notification', '{$a} :: Notificacin Clam AV', null, '1472076097', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2903', 'es', '4', 'virusfounduser', 'The file you have uploaded, {$a->filename}, has been scanned by a virus checker and found to be infected! Your file upload was NOT successful.', 'El archivo subido, {$a->filename}, ha sido escaneado por un antivirus y est infectado. NO se ha podido subir.', null, '1472076097', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2904', 'es', '5', 'actauthhdr', 'Available authentication plugins', 'Plugins de identificacin disponibles', null, '1472076097', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2905', 'es', '5', 'alternatelogin', 'If you enter a URL here, it will be used as the login page for this site. The page should contain a form which has the action property set to <strong>\'{$a}\'</strong> and return fields <strong>username</strong> and <strong>password</strong>.<br />Be careful not to enter an incorrect URL as you may lock yourself out of this site.<br />Leave this setting blank to use the default login page.', 'Si introduce aqu una URL, se usar como pgina de acceso al sitio. La pgina debera contener un formulario cuya propiedad de accin est ajustada a <strong>\'{$a}\'</strong> y devuelve los campos <strong>nombre de usuario</strong> y <strong>contrasea</strong>.<br />Procure no introducir una URL incorrecta puesto que hacerlo supondr su expulsin del sitio.<br />Deje el ajuste en blanco para utilizar la pgina de acceso por defecto.', null, '1472076097', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2906', 'es', '5', 'alternateloginurl', 'Alternate login URL', 'URL de acceso alternativo', null, '1472076097', null, '0', '0');
