INSERT INTO `mdl_tool_customlang` VALUES ('2910', 'es', '5', 'auth_fieldlock', 'Lock value', 'Bloquear valor', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2911', 'es', '5', 'auth_fieldlock_expl', '<p><b>Lock value:</b> If enabled, will prevent Moodle users and admins from editing the field directly. Use this option if you are maintaining this data in the external auth system. </p>', '<p><b>Bloquear valor:</b> Si se activa, los usuarios y administradores de Moodle no podrn editar directamente el campo. Utilice esta opcin si mantiene estos datos en el sistema de identificacin externo. </p>', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2912', 'es', '5', 'auth_fieldlocks', 'Lock user fields', 'Bloquear campos de usuario', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2913', 'es', '5', 'auth_fieldlocks_help', '<p>You can lock user data fields. This is useful for sites where the user data is maintained by the administrators manually by editing user records or uploading using the \'Upload users\' facility. If you are locking fields that are required by Moodle, make sure that you provide that data when creating user accounts or the accounts will be unusable.</p><p>Consider setting the lock mode to \'Unlocked if empty\' to avoid this problem.</p>', '<p>Usted puede bloquear los campos de datos de los usuarios, lo que resulta til en sitios donde esos datos estn mantenidos por administradores de forma manual, editando los registros de los usuarios o subindolos mediante la utilidad \'Subir usuarios\'. Si usted bloquea campos requeridos por Moodle, asegrese de que proporciona esos datos al crear las cuentas de los usuarios; de otro modo las cuentas no sern utilizables.</p><p>Considere fijar esta opcin de bloqueo en \'Desbloqueado si est vaco\', para evitar este problema.</p>', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2914', 'es', '5', 'auth_changepasswordhelp', 'Change password help', 'Ayuda sobre cambio de contrasea', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2915', 'es', '5', 'auth_changepasswordhelp_expl', 'Display lost password help to users who have lost their {$a} password. This will be displayed either as well as or instead of the <strong>Change Password URL</strong> or Internal Moodle password change.', 'Muestra ayuda a los usuarios que han perdido su contrasea {$a}. Esta opcin puede mostrarse como aadidura o en lugar de la <strong>URL de cambio de contrasea</strong> o como un cambio de contrasea interno de Moodle.', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2916', 'es', '5', 'auth_changepasswordurl', 'Change password URL', 'URL Cambio de contrasea', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2917', 'es', '5', 'auth_changepasswordurl_expl', 'Specify the url to send users who have lost their {$a} password. Set <strong>Use standard Change Password page</strong> to <strong>No</strong>.', 'Especifique la URL a la que enviar a los usuarios que han perdido su contrasea {$a}. Seleccione <strong>No</strong> en la <strong>Pgina Usar pgina estndar de cambio de contrasea</strong>.', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2918', 'es', '5', 'auth_changingemailaddress', 'You have requested a change of email address, from {$a->oldemail} to {$a->newemail}. For security reasons, we are sending you an email message at the new address to confirm that it belongs to you. Your email address will be updated as soon as you open the URL sent to you in that message.', 'Usted ha solicitado un cambio de direccin email, desde {$a->oldemail} a {$a->newemail}. Por razones de seguridad, le hemos enviado un mensaje de email a la nueva direccin para confirmar que usted es el titular. Su nueva direccin ser actualizada una vez que abra la direccin que le enviamos en ese mensaje.', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2919', 'es', '5', 'authinstructions', 'Leave this blank for the default login instructions to be displayed on the login page. If you want to provide custom login instructions, enter them here.', 'Deje esta opcin en blanco para mostrar las instrucciones por defecto de entrada al sitio en la pgina de entrada. Si desea proporcionar instrucciones personalizadas introdzcalas aqu.', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2920', 'es', '5', 'auth_invalidnewemailkey', 'Error: if you are trying to confirm a change of email address, you may have made a mistake in copying the URL we sent you by email. Please copy the address and try again.', 'Error: Si est intentando confirmar un cambio de direccin email. debe haber cometido un error al copiar la URL que le enviamos por email. Por favor, copie la direccin y pruebe de nuevo.', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2921', 'es', '5', 'auth_multiplehosts', 'Multiple hosts OR addresses can be specified (eg host1.com;host2.com;host3.com) or (eg xxx.xxx.xxx.xxx;xxx.xxx.xxx.xxx)', 'Es posible especificar mltiples servidores (por ej. servidor1.com;servidor2.com;servidor3.com', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2922', 'es', '5', 'auth_notconfigured', 'The authentication method {$a} is not configured.', 'El mtodo de autenticacin {$a} no est configurado.', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2923', 'es', '5', 'auth_outofnewemailupdateattempts', 'You have run out of allowed attempts to update your email address. Your update request has been cancelled.', 'Ha hecho ms intentos de los permitidos para actualizar su direccin de email. Su solicitud de actualizacin ha sido cancelada.', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2924', 'es', '5', 'auth_passwordisexpired', 'Your password is expired. Do you want change your password now?', 'Su contrasea ha caducado Desea cambiar su contrasea ahora?', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2925', 'es', '5', 'auth_passwordwillexpire', 'Your password will expire in {$a} days. Do you want change your password now?', 'Su contrasea caducar en {$a} das Desea cambiar su contrasea ahora?', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2926', 'es', '5', 'auth_remove_delete', 'Full delete internal', 'Borrado completo', null, '1472076099', null, '0', '0');
