INSERT INTO `mdl_tool_customlang` VALUES ('2929', 'es', '5', 'auth_remove_user', 'Specify what to do with internal user account during mass synchronization when user was removed from external source. Only suspended users are automatically revived if they reappear in ext source.', 'Especifique qu hacer con una cuenta de usuario interna durante sincronizacin masiva cuando el usuario fue eliminado de la fuente externa. nicamente los usuarios suspendidos son automticamente revividos si ellos reaparecen en una fuente externa.', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2930', 'es', '5', 'auth_remove_user_key', 'Removed ext user', 'Usuario externo eliminado', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2931', 'es', '5', 'auth_sync_suspended', 'When enabled, the suspended attribute will be used to update the local user account\'s suspension status.', 'When enabled, the suspended attribute will be used to update the local user account\'s suspension status.', null, '1472076099', null, '0', '0');
