INSERT INTO `mdl_tool_customlang` VALUES ('2933', 'es', '5', 'auth_sync_script', 'User account syncronisation', 'Script de sincronizacin del Cron', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2934', 'es', '5', 'auth_updatelocal', 'Update local', 'Actualizar datos locales', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2935', 'es', '5', 'auth_updatelocal_expl', '<p><b>Update local:</b> If enabled, the field will be updated (from external auth) every time the user logs in or there is a user synchronization. Fields set to update locally should be locked.</p>', '<p><b>Actualizar datos locales:</b> Si est activado, el campo debe ser actualizado (con identificacin externa) cada vez que el usuario entra o se produce una sincronizacin de usuarios. Los campos a actualizar localmente deberan ser bloqueados.</p>', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2936', 'es', '5', 'auth_updateremote', 'Update external', 'Actualizar datos externos', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2937', 'es', '5', 'auth_updateremote_expl', '<p><b>Update external:</b> If enabled, the external auth will be updated when the user record is updated. Fields should be unlocked to allow edits.</p>', '<p><b>Actualizar datos externos:</b> Si est activado, la identificacin externa ser actualizada cuando se actualice el registro del usuario. Los campos deberan estar desbloqueados para poder editarlos.</p>', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2938', 'es', '5', 'auth_updateremote_ldap', '<p><b>Note:</b> Updating external LDAP data requires that you set binddn and bindpw to a bind-user with editing privileges to all the user records. It currently does not preserve multi-valued attributes, and will remove extra values on update. </p>', '<p><b>Note:</b> La actualizacin de datos LDAP externos requiere que usted ajuste los valores \'binddn\' y \'bindpw\' a un usuario con privilegios de edicin de todos los registros de usuario. Por el momento, esto no preserva los atributos multi-valor, y eliminar los valores extra durante la actualizacin. </p>', null, '1472076100', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2939', 'es', '5', 'auth_user_create', 'Enable user creation', 'Habilitar creacin por parte del usuario', null, '1472076100', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2940', 'es', '5', 'auth_user_creation', 'New (anonymous) users can create user accounts on the external authentication source and confirmed via email. If you enable this , remember to also configure module-specific options for user creation.', 'Los nuevos usuarios (annimos) pueden crear cuentas de usuario sobre el cdigo externo de identificacin y confirmar va correo electrnico. Si usted habilita esto, recuerde tambin configurar las opciones del mdulo especfico para la creacin de usuario.', null, '1472076100', null, '0', '0');
