INSERT INTO `mdl_tool_customlang` VALUES ('2949', 'es', '5', 'emailupdatemessage', 'Dear {$a->fullname},\n\nYou have requested a change of your email address for your user account at {$a->site}. Please open the following URL in your browser in order to confirm this change.\n\n{$a->url}', 'Estimado(a) {$a->fullname},\n\nHa solicitado un cambio de su direccin email en su cuenta de {$a->site}. Abra por favor la siguiente direccin en su navegador para confirmar este cambio.\n\n{$a->url}', null, '1472076101', null, '0', '0');
