INSERT INTO `mdl_tool_customlang` VALUES ('2968', 'es', '5', 'forgottenpassword', 'If you enter a URL here, it will be used as the lost password recovery page for this site. This is intended for sites where passwords are handled entirely outside of Moodle. Leave this blank to use the default password recovery.', 'Si escribe aqu una URL, se usar como pgina de recuperacin de la contrasea perdida para este sitio. Esto est pensado para sitios en los que las contraseas se gestionan totalmente fuera de Moodle. Djelo en blanco para usar la recuperacin por defecto de la contrasea.', null, '1472076103', null, '0', '0');
