INSERT INTO `mdl_tool_customlang` VALUES ('2977', 'es', '5', 'chooseauthmethod_help', 'This setting determines the authentication method used when the user logs in. Only enabled authentication plugins should be chosen, otherwise the user will no longer be able to log in. To block the user from logging in, select \"No login\".', 'Este elemento determina el mtodo de autentificacin utilizado cuando el usuario entra en el sitio. Slo deben elegirse los plugins de actualizacin que hayan sido habilitados, si no fuera as el usuario no podra conectarse. Para bloquear la entrada del usuario, seleccione \'Sin login\'.', null, '1472076103', null, '0', '0');
