INSERT INTO `mdl_tool_customlang` VALUES ('2990', 'es', '5', 'limitconcurrentlogins_desc', 'If enabled the number of concurrent browser logins for each user is restricted. The oldest session is terminated after reaching the limit, please note that users may lose all unsaved work. This setting is not compatible with single sign-on (SSO) authentication plugins.', 'Si se activa se limitar el nmero de inicios de sesin va navegador para cada usuario. La sesin ms vieja ser cerrada despus de alcanzar el lmite, por favor indique a los usuarios que pueden perder todo el trabajo no guardado. Esta configuracin no es compatible con plugins de autentificacin de un slo uso.', null, '1472076104', null, '0', '0');
