INSERT INTO `mdl_tool_customlang` VALUES ('2993', 'es', '5', 'authloginviaemail_desc', 'Allow users to use both username and email address (if unique) for site login.', 'Permitir a los usuarios acceder al sitio indistintamente con su nombre de usuario o con su  direccin de correo (siempre que sea nica).', null, '1472076104', null, '0', '0');
