INSERT INTO `mdl_tool_customlang` VALUES ('3179', 'es', '7', 'filealiasesrestorefailures_help', 'Aliases are symbolic links to other files, including those stored in external repositories. In some cases, Moodle cannot restore them - for example when restoring the backup at another site or when the referenced file does not exist.\n\nMore details and the actual reason of the failure can be found in the restore log file.', 'Los alias son enlaces simblicos a otros archivos, incluyendo aquellos almacenados en repositorios externos. En algunos casos, Moodle no puede restaurarlos - por ejemplo cuando se restaura una copia de seguridad en otro sitio o cuando el archivo al que se hace referencia no existe.', null, '1472076119', null, '0', '0');
