INSERT INTO `mdl_tool_customlang` VALUES ('3358', 'es', '8', 'archiveconfirm', 'Delete and keep existing issued badges', 'Eliminar y mantener las insignias otorgadas existentes', null, '1472076135', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3359', 'es', '8', 'archivehelp', '<p>This option means that the badge will be marked as \"retired\" and will no longer appear in the list of badges. Users will no longer be able to earn this badge, however existing badge recipients will still be able to display this badge on their profile page and push it to their external backpacks.</p>\n<p>If you would like your users to retain access to the earned badges it is important to select this option instead of fully deleting badges.</p>', '<p>Esta opcin significa que la insignia se marcar como \"retirada\" y ya no aparecer en la lista de insignias. Los usuarios no podrn ganar esta insignia, sin embargo los destinatarios de la insignia existentes seguirn pudiendo mostrarla en su pgina de perfil y subirla a sus mochilas externas. </p>\n<p> Si desea que sus usuarios pueden mantener el acceso a las insignias obtenidas es importante seleccionar esta opcin en lugar de eliminar totalmente las insignias.</p>', null, '1472076135', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3360', 'es', '8', 'attachment', 'Attach badge to message', 'Adjuntar insignia al mensaje', null, '1472076135', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3361', 'es', '8', 'attachment_help', 'If enabled, an issued badge file will be attached to the recipient\'s email for download. (Attachments must be enabled in Site administration > Plugins > Message outputs > Email to use this option.)', 'Si se selecciona, se adjuntar una insignia al correo electrnico que se podr descargar', null, '1472076136', null, '0', '0');
