INSERT INTO `mdl_tool_customlang` VALUES ('3364', 'es', '8', 'awardoncron', 'Access to the badges was successfully enabled. Too many users can instantly earn this badge. To ensure site performance, this action will take some time to process.', 'El acceso a las insignias se activ con xito. Muchos usuarios pueden ganar simultneamente esta insignia. Para garantizar el funcionamiento del sitio, esta accin llevar un cierto tiempo de proceso.', null, '1472076136', null, '0', '0');
