INSERT INTO `mdl_tool_customlang` VALUES ('3366', 'es', '8', 'backpackavailability', 'External badge verification', 'Verificacin externa de la insignia', null, '1472076136', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3367', 'es', '8', 'backpackavailability_help', 'For badge recipients to be able to prove they earned their badges from you, an external backpack service should be able to access your site and verify badges issued from it. Your site does not currently appear to be accessible, which means that badges you have already issued or will issue in the future cannot be verified.\n\n**Why am I seeing this message?**\n\nIt may be that your firewall prevents access from users outside your network, your site is password protected, or you are running the site on a computer that is not available from the Internet (such as a local development machine).\n\n**Is this a problem?**\n\nYou should fix this issue on any production site where you are planning to issue badges, otherwise the recipients will not be able to prove they earned their badges from you. If your site is not yet live you can create and issue test badges, as long as the site is accessible before you go live.\n\n**What if I can\'t make my whole site publicly accessible?**\n\nThe only URL required for verification is [your-site-url]/badges/assertion.php so if you are able to modify your firewall to allow external access to that file, badge verification will still work.', 'Para que los receptores de insignias puedan demostrar que han ganado insignias emitidas por usted, un servicio de mochila externo debe poder acceder a su sitio y verificar las insignias emitidas desde aqu.\n\nSu sitio no aparece que sea accesible en este momento, lo que significa que las insignias que ya haya emitido o que se emitan en el futuro no se podrn verificar.\n\n## Por qu me sale este mensaje?\n\nPuede ser que el firewall impida el acceso de usuarios externos a la red, que el sitio est protegido con contrasea, o que se est ejecutando el sitio en un equipo que no est disponible en Internet (por ejemplo, una mquina de desarrollo local).\n\n## Es un problema?\n\nDebe solucionar este problema en cada sitio en produccin donde vaya a emitir insignias, de lo contrario los destinatarios no sern capaces de probar que han ganado las insignias emitidas por usted\n\nSi su sitio no est activo puede crear y suministrar insignias de prueba, siempre y cuando el sitio sea accesible antes de activarse.\n\n## Qu pasa si no puedo dar acceso pblico completo a mi sitio?\n\nLa nica URL necesaria para la verificacin es [su-sitio-url]/badges/assertion.php, por lo que si usted puede modificar el firewall para permitir el acceso externo a ese archivo, la verificacin de las  insignias seguir funcionando.', null, '1472076136', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3368', 'es', '8', 'backpackbadges', 'You have {$a->totalbadges} badge(s) displayed from {$a->totalcollections} collection(s). <a href=\"mybackpack.php\">Change backpack settings</a>.', 'Usted tiene {$a->totalbadges} insignias que se muestran desde {$a->totalcollections} colecciones. <a href=\"mybackpack.php\">Cambiar la configuracin de la mochila</a> .', null, '1472076136', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3369', 'es', '8', 'backpackconnection', 'Backpack connection', 'Conexin a la mochila', null, '1472076136', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3370', 'es', '8', 'backpackconnection_help', 'This page allows you to set up connection to an external backpack provider. Connecting to a backpack lets you display external badges within this site and push badges earned here to your backpack.\n\nCurrently, only <a href=\"http://backpack.openbadges.org\">Mozilla OpenBadges Backpack</a> is supported. You need to sign up for a backpack service before trying to set up backpack connection on this page.', 'Esta pgina le permite configurar la conexin a un proveedor externo de mochilas. Conectarse a una mochila le permite mostrar insignias externas dentro de este sitio y subir las insignias ganadas aqu a su mochila.\n\nActualmente, slo <a href=\"http://backpack.openbadges.org\">Mochila OpenBadges Mozilla</a> es compatible. Es necesario inscribirse para tener un servicio de mochila antes de tratar de configurar la conexin a la mochila en esta pgina.', null, '1472076136', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3371', 'es', '8', 'backpackdetails', 'Backpack settings', 'Configuracin de la mochila', null, '1472076136', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3372', 'es', '8', 'backpackemail', 'Email address', 'Direccin de correo electrnico', null, '1472076136', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3373', 'es', '8', 'backpackemail_help', 'The email address associated with your backpack. While you are connected, any badges earned on this site will be associated with this email address.', 'La direccin de correo electrnico asociada a su mochila. Mientras est conectado, las insignias obtenidas en este sitio se asociarn con esta direccin de correo electrnico.', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3374', 'es', '8', 'personaconnection', 'Sign in with your email', 'Inicie sesin con su direccin de email', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3375', 'es', '8', 'personaconnection_help', 'Persona is a system for identifying yourself across the web, using an email address that you own. The Open Badges backpack uses Persona as a login system, so to be able to connect to a backpack you will need a Persona account.\n\nFor more information about Persona visit <a href=\"https://login.persona.org/about\">https://login.persona.org/about</a>.', 'Persona es un sistema para su identificacin en la web, usando una direccin de correo electrnico de su propiedad. La mochila de Open Badges utiliza Persona como sistema de inicio de sesin, por lo que para conectarse a una mochila necesita una cuenta de Persona. Para obtener ms informacin acerca de Persona visite <a href=\"https://login.persona.org/about\">https://login.persona.org/about</a> .', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3376', 'es', '8', 'backpackimport', 'Badge import settings', 'Ajustes de importacin de insignias', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3377', 'es', '8', 'backpackimport_help', 'After the backpack connection is successfully established, badges from your backpack can be displayed on your badges page and your profile page.\n\nIn this area, you can select collections of badges from your backpack that you would like to display in your profile.', 'Despus de establecerse una conexin correcta a la mochila, las insignias de su mochila pueden verse en la pgina \"Mis Badges\"  y en su pgina de perfil.\n\nEn esta rea, puede seleccionar las colecciones de insignias de su mochila que quiera mostrar  en su perfil.', null, '1472076137', null, '0', '0');
