INSERT INTO `mdl_tool_customlang` VALUES ('3381', 'es', '8', 'badgeimage_help', 'This is an image that will be used when this badge is issued.\n\nTo add a new image, browse and select an image (in JPG or PNG format) then click \"Save changes\". The image will be cropped to a square and resized to match badge image requirements. ', 'Esta es una imagen que se utilizar cuando se emite esta insignia.\n\nPara agregar una nueva imagen, busque y seleccione una imagen (en formato JPG o PNG) y luego haga clic en \"Guardar cambios\". La imagen se recorta y cambia de tamao para ajustarse a los requisitos de la imagen de la insignia.', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3382', 'es', '8', 'badgeprivacysetting', 'Badge privacy settings', 'Configuracin de privacidad de la insignia', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3383', 'es', '8', 'badgeprivacysetting_help', 'Badges you earn can be displayed on your account profile page. This setting allows you to automatically set the visibility of the newly earned badges.\n\nYou can still control individual badge privacy settings on your badges page.', 'Las insignias que usted gane se pueden mostrar en su pgina de perfil de cuenta. Este ajuste le permite mostrar automticamente las insignias recintemente ganadas.\n\nPuede controlar la configuracin de privacidad de las insignias individuales en la pgina \"Mis insignias\".', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3384', 'es', '8', 'badgeprivacysetting_str', 'Automatically show badges I earn on my profile page', 'Mostrar automticamente en mi pgina de perfil las insignias que he ganado', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3385', 'es', '8', 'badgesalt', 'Salt for hashing the recipient\'s email address', 'Salado hash para la direccin de correo electrnica del destinatario', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3386', 'es', '8', 'badgesalt_desc', 'Using a hash allows backpack services to confirm the badge earner without having to expose their email address. This setting should only use numbers and letters.\n\nNote: For recipient verification purposes, please avoid changing this setting once you start issuing badges.', 'Usar un \'hash\' permite que los servicios de mochila confirmen el origen de la insignia sin tener que mostrar su direccin de correo electrnico. Este ajuste debe utilizar solo nmeros y letras.\n\nObservacin: Con fines de verificacin de los receptores, evite cambiar este ajuste una vez que comience la emisin de insignias', null, '1472076137', null, '0', '0');
