INSERT INTO `mdl_tool_customlang` VALUES ('3465', 'es', '8', 'criterror_help', 'This fieldset shows all parameters that were initially added to this badge requirement but are no longer available. It is recommended that you un-check such parameters to make sure that users can earn this badge in the future.', 'Este conjunto de campos muestra todos los parmetros que inicialmente se aadieron a los requisitos de la insignia, pero que ya no estn disponibles. Se recomienda que estos parmetros se desactiven para asegurarse de que los estudiantes puedan obtener esta insignia en el futuro.', null, '1472076144', null, '0', '0');
