INSERT INTO `mdl_tool_customlang` VALUES ('3479', 'es', '8', 'deletehelp', '<p>Fully deleting a badge means that all its information and criteria records will be permanently removed. Users who have earned this badge will no longer be able to access it and display it on their profile pages.</p>\n<p>Note: Users who have earned this badge and have already pushed it to their external backpack, will still have this badge in their external backpack. However, they will not be able to access criteria and evidence pages linking back to this web site.</p>', '<p>Borrar completamente una insignia significa que todos sus registros de informacin y criterios se eliminarn de forma permanente. Los usuarios que han ganado esta insignia ya no sern capaces de acceder a ella y mostrarla en sus pginas de perfil.</p> <p>Nota: Los usuarios que hayan ganado esta placa y la hayan subido a su mochila externa, an la tendrn en su mochila. Sin embargo, no podrn acceder a los criterios ni las pginas de evidencia que enlazan con este sitio web.</p>', null, '1472076145', null, '0', '0');
