INSERT INTO `mdl_tool_customlang` VALUES ('3595', 'es', '8', 'reviewconfirm', '<p>This will make your badge visible to users and allow them to start earning it.</p>\n\n<p>It is possible that some users already meet this badge\'s criteria and will be issued this badge immediately after you enable it.</p>\n\n<p>Once a badge has been issued it will be <strong>locked</strong> - certain settings including the criteria and expiry settings can no longer be changed.</p>\n\n<p>Are you sure you want to enable access to the badge \'{$a}\'?</p>', '<p> Con esto, har que su insignia sea visible para los usuarios y les permita empezar a ganarla</p>\n\n<p> Es posible que algunos usuarios ya cumplan los criterios de esta insignia y que se les entregue inmediatamente despus de que la haya activado. </p>\n\n<p> Una vez que la insignia haya sido emitida ser <strong>bloqueada</strong> - ciertos ajustes incluyendo los criterios y los ajustes de caducidad ya no se podrn modificar. </p>\n\n<p> Est seguro de que desea permitir el acceso a la insignia \'{$a}\'? </p>', null, '1472076155', null, '0', '0');
