INSERT INTO `mdl_tool_customlang` VALUES ('3605', 'es', '8', 'sitebadges_help', 'Site badges can only be awarded to users for site-related activities. These include completing a set of courses or parts of user profiles. Site badges can also be issued manually by one user to another.\n\nBadges for course-related activities must be created at the course level. Course badges can be found under Course Administration > Badges.', 'Las insignias del sitio slo pueden ser otorgadas a los usuarios de las actividades relacionadas con el sitio. Estos incluyen completar una serie de cursos o partes de los perfiles de usuario. Las insignias del sitio tambin pueden ser emitidas manualmente por un usuario para otro.\n\nLa insignias para las actividades relacionadas con los cursos deben ser creados a nivel de curso. Las insignias de curso se pueden encontrar en Administracin >  Insignias', null, '1472076156', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3606', 'es', '8', 'statusmessage_0', 'This badge is currently not available to users. Enable access if you want users to earn this badge. ', 'Esta insignia no est en este momento disponible para los usuarios. Habilite el acceso si desea que los usuarios puedan ganar esta insignia.', null, '1472076156', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3607', 'es', '8', 'statusmessage_1', 'This badge is currently available to users. Disable access to make any changes. ', 'Esta insignia est en este momento disponible para los usuarios. Deshabilite el acceso para hacer cualquier cambio.', null, '1472076156', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3608', 'es', '8', 'statusmessage_2', 'This badge is currently not available to users, and its criteria are locked. Enable access if you want users to earn this badge. ', 'Esta insignia no est en este momento disponible para los usuarios, y los criterios estn bloqueados. Habilite el acceso si desea que los usuarios puedan ganar esta insignia.', null, '1472076156', null, '0', '0');
