INSERT INTO `mdl_tool_customlang` VALUES ('3611', 'es', '8', 'status', 'Badge status', 'Estado de la insignia', null, '1472076156', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3612', 'es', '8', 'status_help', 'Status of a badge determines its behaviour in the system:\n\n* **AVAILABLE**  Means that this badge can be earned by users. While a badge is available to users, its criteria cannot be modified.\n\n* **NOT AVAILABLE**  Means that this badge is not available to users and cannot be earned or manually issued. If such badge has never been issued before, its criteria can be changed.\n\nOnce a badge has been issued to at least one user, it automatically becomes **LOCKED**. Locked badges can still be earned by users, but their criteria can no longer be changed. If you need to modify details or criteria of a locked badge, you can duplicate this badge and make all the required changes.\n\n*Why do we lock badges?*\n\nWe want to make sure that all users complete the same requirements to earn a badge. Currently, it is not possible to revoke badges. If we allowed badges requirements to be modified all the time, we would most likely end up with users having the same badge for meeting completely different requirements.', 'El estado de una insignia determina su comportamiento en el sistema:\n\n* ** DISPONIBLE ** - Significa que esta insignia puede ser ganada por los usuarios. Mientras que una insignia est disponible para los usuarios, los criterios no pueden ser modificados.\n\n* ** NO DISPONIBLE ** - Significa que esta insignia no est disponible para los usuarios y no se puede ganar o emitir manualmente. Si dicha insignia no ha sido emitida antes, los criterios pueden cambiarse.\n\nUna vez que una insignia ha sido emitida por lo menos para un usuario, pasa automticamente a **BLOQUEADA**.  Los usuarios pueden ontener insignias bloqueadas,  pero sus criterios ya no se pueden cambiar. Si necesita modificar detalles o criterios de una insignia bloqueada, puede duplicar esta insignia y hacer todos los cambios necesarios.\n\n* Por qu bloqueamos insignias? *\n\nPara asegurarnos de que todos los usuarios tengan los mismos requisitos para ganar una insignia. En este momento, no es posible revocar insignias. Si permitimos que los requisitos de las insignias se puedan modificar en cualquier momento, lo ms probable es que al final usuarios que tienen la misma insignia hayan tenido que satisfacer requisitos completamente diferentes.', null, '1472076156', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3613', 'es', '8', 'subject', 'Message subject', 'Asunto del mensaje', null, '1472076157', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3614', 'es', '8', 'variablesubstitution', 'Variable substitution in messages.', 'Sustitucin de variables en los mensajes.', null, '1472076157', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3615', 'es', '8', 'variablesubstitution_help', 'In a badge message, certain variables can be inserted into the subject and/or body of a message so that they will be replaced with real values when the message is sent. The variables should be inserted into the text exactly as they are shown below. The following variables can be used:\n\n%badgename%\n: This will be replaced by the badge\'s full name.\n\n%username%\n: This will be replaced by the recipient\'s full name.\n\n%badgelink%\n: This will be replaced by the public URL with information about the issued badge.', 'En un mensaje de insignia, ciertas variables se pueden insertar en el asunto y/o en el cuerpo del mensaje para que puedan ser sustituidas por valores reales cuando se enva el mensaje. Las variables deben insertarse en el el texto tal y como se muestra a continuacin. Se pueden utilizar las siguientes variables:\n\n%badgename%\n: ser reemplazado por el nombre completo de la insignia.\n\n%username%\n: ser reemplazado por el nombre completo del destinatario.\n\n%badgelink%\n: ser reemplazado por el URL pblica con informacin sobre la insignia emitida.', null, '1472076157', null, '0', '0');
