INSERT INTO `mdl_tool_customlang` VALUES ('3629', 'es', '9', 'contexts_help', 'Contexts are more specific types of pages where this block can be displayed within the original block location. You will have different options here depending on the original block location and your current location. For example, you can restrict a block to only appearing on forum pages in a course by adding the block to the course (making it appear on all sub-pages), then going into a forum and editing the block settings again to restrict display to just forum pages.', 'Los contextos son tipos ms especficos de pginas donde este bloque puede ser mostrado dentro de la ubicacin original del bloque. Dispondr de diferentes opciones aqu dependiendo de la ubicacin original del bloque y la ubicacin actual de usted. Por ejemplo, puede restringir un bloque para que nicamente aparezca en las pginas de foros de un curso aadiendo el bloque al curso (haciendo qeu aparezca en todas las sub-pginas), y luego entrando en el foro y editando los ajustes del bloque de nuevo para restringir su visualizacin slo a las pginas de foros.', null, '1472076158', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3630', 'es', '9', 'createdat', 'Original block location', 'Ubicacin original del bloque', null, '1472076158', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3631', 'es', '9', 'createdat_help', 'The original location where the block was created. Block settings may cause it to appear in other locations (contexts) within the original location. For example, a block created on a course page could be displayed in activities within that course. A block created on the front page can be displayed throughout the site.', 'La ubicacin original donde se creo el bloque. Los ajustes del bloque pueden hacer que aparezca en otras ubicaciones (contextos) dentro de la ubicacin original. Por ejemplo, un bloque creado en una pgina de curso podra ser mostrado en las actividades dentro de ese curso. Un bloque creado en la portada puede ser mostrado en todo el sitio.', null, '1472076158', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3632', 'es', '9', 'defaultregion', 'Default region', 'Regin por defecto', null, '1472076158', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3633', 'es', '9', 'defaultregion_help', 'Themes may define one or more named block regions where blocks are displayed. This setting defines which of these you want this block to appear in by default. The region may be overridden on specific pages if required.', 'Los temas pueden definir una o ms regiones de bloques con nombre donde se pueden mostrar los bloques. Este ajuste define en cules de stas quiere que aparezca este bloque por defecto. La regin puede ser anulada en pginas especficas si es necesario.', null, '1472076158', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3634', 'es', '9', 'defaultweight', 'Default weight', 'Peso por defecto', null, '1472076158', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3635', 'es', '9', 'defaultweight_help', 'The default weight allows you to choose roughly where you want the block to appear in the chosen region, either at the top or the bottom. The final location is calculated from all the blocks in that region (for example, only one block can actually be at the top). This value can be overridden on specific pages if required.', 'El peso por defecto permite escoger aproximdamente donde quiere que aparezca el bloque en la regin escogida, bien arriba del todo o al fondo. La ubicacin final se calcula a partir de todos los bloques en esa regin (por ejemplo, slo un bloque puede estar arriba del todo). Este valor puede ser anulado en pginas especficas si es necesario.', null, '1472076158', null, '0', '0');
