INSERT INTO `mdl_tool_customlang` VALUES ('3639', 'es', '9', 'deleteblockwarning', '<p>You are about to delete a block that appears elsewhere.</p><p>Original block location: {$a->location}<br />Display on page types: {$a->pagetype}</p><p>Are you sure you want to continue?</p>', '<p> Est a punto de borrar un bloque que aparece en otra parte. </p><p> La ubicacin original del bloque es: {$a->location} <br /> Mostrar el tipo de pgina: {$a->pagetype} </p><p> Est seguro que desea continuar? </p>', null, '1472076158', null, '0', '0');
