INSERT INTO `mdl_tool_customlang` VALUES ('3843', 'es', '11', 'users_help', 'All users who passed the active filters are listed in the available box. If no filter is set, all site users are listed.', '<h2>Listas de usuarios</h2>\n\n<p>La lista <strong>disponible</strong> contiene a los usuarios que han superado los filtros activos. Por ejemplo, si la seccin de filtros activos contienen slo un filtro para los usuarios cuyo pas es Espaa, entonces la lista disponible contendr nicamente a los usuarios que hayan sealado Espaa como su pas en la pgina de perfil.</p>\n\n<p>La lista <strong>seleccionada</strong> contiene a los usuarios que han sido agregados a la lista por usted, utilizando los botones de la seccin <em>Lista de usuarios seleccionados...</em>. Cuando se pulsa el botn <em>Ir</em> en <em>Con los usuarios seleccionados...</em>, la operacin seleccionada en esta seccin se llevar a cabo sobre los usuarios de esta lista.</p>', null, '1472076175', null, '0', '0');
