INSERT INTO `mdl_tool_customlang` VALUES ('4125', 'es', '13', 'pref_lookahead_help', 'This sets the (maximum) number of days in the future that an event has to start in in order to be displayed as an upcoming event. Events that start beyond this will never be displayed as upcoming. Please note that <strong>there is no guarantee</strong> that all events starting in this time frame will be displayed; if there are too many (more than the \"Maximum upcoming events\" preference) then the most distant events will not be shown.', 'Esta opcin ajusta el nmero (mximo) de das en que un evento debe comenzar a fin de poder mostrarse como evento pendiente. Por favor, note que <strong>no hay garanta</strong> de que se muestren todos los eventos que comiencen en esa fecha; si hay demasiados (ms que los sealados en la preferencia \"Nmero mximo de eventos pendientes\"), los eventos ms distantes no se mostrarn.', null, '1472076198', null, '0', '0');
