INSERT INTO `mdl_tool_customlang` VALUES ('4127', 'es', '13', 'pref_maxevents_help', 'This sets the maximum number of upcoming events that can be displayed. If you pick a large number here it is possible that upcoming events displays will take up a lot of space on your screen.', 'Esta opcin fija el nmero mximo de eventos pendientes que pueden mostrarse. Si escribe un nmero elevado, es posible que mostrar los eventos ocupe mucho espacio en la pantalla.', null, '1472076198', null, '0', '0');
