INSERT INTO `mdl_tool_customlang` VALUES ('4384', 'es', '17', 'completedwarningtext', 'This activity has already been marked as completed for {$a} participant(s). Changing completion options will erase their completion state and may cause confusion. Thus the options have been locked and should not be unlocked unless absolutely necessary.', 'Uno o ms estudiantes ({$a}) ya ha(n) marcado esta actividad como finalizada. Cambiar las opciones de finalizacin borrar su estado de finalizacin y puede ocasionar confusin. Por tanto, estas opciones han sido bloqueadas y no se deberan desbloquear salvo que fuera absolutamente necesario.', null, '1472076221', null, '0', '0');
