INSERT INTO `mdl_tool_customlang` VALUES ('4400', 'es', '17', 'completion_automatic', 'Show activity as complete when conditions are met', 'Mostrar la actividad como completada cuando se cumplan las condiciones', null, '1472076222', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4401', 'es', '17', 'completion_help', 'If enabled, activity completion is tracked, either manually or automatically, based on certain conditions. Multiple conditions may be set if desired. If so, the activity will only be considered complete when ALL conditions are met.\n\nA tick next to the activity name on the course page indicates when the activity is complete.', 'Si se activa esta opcin, se rastrea el grado de finalizacin de cualquier actividad, bien manual, bien automticamente, basndose en determinadas condiciones. Si se desea, se pueden fijar mltiples condiciones. Si se hace as, la actividad nicamente se considerar completa si se cumplen TODAS las condiciones.\n\nUna marca al lado del nombre de la actividad enla pgina del curso indica cundo la actividad est completa.', null, '1472076222', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4402', 'es', '17', 'completion_link', 'activity/completion', 'activity/completion', null, '1472076222', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4403', 'es', '17', 'completion_manual', 'Students can manually mark the activity as completed', 'Los estudiantes pueden marcar manualmente la actividad como completada', null, '1472076223', null, '0', '0');
