INSERT INTO `mdl_tool_customlang` VALUES ('4408', 'es', '17', 'completionenabled', 'Enabled, control via completion and activity settings', 'Activado, control por medio de los ajustes de finalizacin y de actividad', null, '1472076223', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4409', 'es', '17', 'completionexpected', 'Expect completed on', 'Se espera finalizar en', null, '1472076223', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4410', 'es', '17', 'completionexpected_help', 'This setting specifies the date when the activity is expected to be completed. The date is not shown to students and is only displayed in the activity completion report.', 'Esta opcin especifica la fecha en que se espera que la actividad est finalizada. La fecha no se muestra a los estudiantes y aparece nicamente en el informe de progreso.', null, '1472076223', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4411', 'es', '17', 'completionicons', 'Completion tick boxes', 'Casillas para marcar el grado de finalizacin', null, '1472076223', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4412', 'es', '17', 'completionicons_help', 'A tick next to an activity name may be used to indicate when the activity is complete.\n\nIf a box with a dotted border is shown, a tick will appear automatically when you have completed the activity according to conditions set by the teacher.\n\nIf a box with a solid border is shown, you can click it to tick the box when you think you have completed the activity. (Clicking it again removes the tick if you change your mind.) The tick is optional and is simply a way of tracking your progress through the course.', 'Una marca junto al nombre de la actividad puede utilizarse para indicar que una actividad se complet.\n\nSi se muestra una casilla con el borde punteado, la marca aparecer automticamente cuando se haya completado la actividad de acuerdo con las condiciones establecidas por el profesor.\n\nSi se muestra una casilla con el borde slido, entonces ser posible hacer clic sobre ella cuando piense que ha finalizado la actividad. (Si se vuelve a hacer clic sobre ella, la marca desaparece en caso de que haya cambiado de opinin). Esto es una accin opcional que se utiliza para llevar un seguimiento personal del progreso a travs del curso.', null, '1472076223', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4413', 'es', '17', 'completionmenuitem', 'Completion', 'Finalizacin', null, '1472076223', null, '0', '0');
